(1, 51, '5c9c1ff62ce0c3.78174962', '5d1bca1c078fa7.60446981', 5, 'Me gusto mucho el café. Excelente sabor, acidez perfecta. ', 'activo', '2019-07-24 16:48:43'),
(2, 34, '5c9c1ff62ce0c3.78174962', '5d1bca1c078fa7.60446981', 5, 'Superaron mis expectativas!!! Están muy bien hechos. Hay unas figuras pequeñas, pero tienen todos los detalles. Me parece un muy buen regalo..', 'activo', '2019-07-24 16:50:38'),
(3, 51, '5c9c1ff62ce0c3.78174962', '5d2bff99f10866.21705627', 5, 'De-li-cio-so café , esta perfectamente bien balanceado.', 'activo', '2019-07-24 19:16:56'),
