(6, 3, '5c9c1ff62ce0c3.78174962', '5d2d355223a712.73640364', 5, 'El sistema de seguro es muy útil, permite guardar las pinzas sin que se atoren con otras cosas del cajón. La cubierta de silicona ayuda a conservar las sartenes de teflón. Buen producto a buen precio.', 'activo', '2019-08-22 14:58:26'),
