(1, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Tijeras de cocina.', 'tijeras-de-cocina', '<p>Tijeras de cocina multiusos con abre nueces integrado.</p>\r\n', '<ul>\r\n	<li>﻿﻿Tijeras de acero inoxidable de 20 cent&iacute;metros de excelente calidad.</li>\r\n	<li>Muy resistentes y de larga duraci&oacute;n.&nbsp;</li>\r\n	<li>Cuentan con un abre nueces y un abridor de botellas o tarros.</li>\r\n	<li>Son aptas para ser lavadas en lavavajillas.&nbsp;</li>\r\n	<li>Ser&aacute;n las &uacute;ltimas tijeras que compres.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '105.00', '0.00', 'MXN', 'no', 'no', 2, 1, 1, 'No disponible para la venta', '2019-08-02 19:02:45', '2019-08-02 19:02:45', '2019-08-02 19:02:45', '12.00', '18.00', '2.00', '0.20', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(2, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Para el corte y recorte, abanicoytu te tiene este excelente juego de tijeras para todo uso en la casa y oficina. Importado de USA.', 'juego-de-tijeras-para-cocina', '<ul>\r\n	<li>Este juego de tijeras es uno de los productos favoritos en el mercado, y es que son uno de esos utensilio que no pueden de faltar en la casa y&nbsp;la oficina, por lo cual es importante&nbsp;tener un juego de tijeras de excelente calidad que nos duren&nbsp;muchos a&ntilde;os.&nbsp;</li>\r\n	<li>Este excelente juego de tijeras&nbsp;reune caracter&iacute;sticas que lo hacen una buena&nbsp;inversi&oacute;n a largo plazo.&nbsp;</li>\r\n	<li>Su suave recubrimiento en el mango permite un &oacute;ptimo agarre&nbsp;y control total.&nbsp;</li>\r\n	<li>Ideales para trabajos escolares y la oficina.</li>\r\n	<li>El cuerpo de acero inoxidable le brinda&nbsp; gran resistencia.&nbsp;</li>\r\n	<li>El set incluye 1 par de tijeras de&nbsp; 21.6 cm y 2 pares de 13 cm.</li>\r\n	<li>Puedes cortar papel, cart&oacute;n, tela y hasta carne.</li>\r\n	<li>Producto importado de Estados Unidos.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Solo por el mes de julio, ll&eacute;vate 2 pares por solo $264.10</strong></li>\r\n</ul>\r\n', '<ul>\r\n	<li>Garant&iacute;a de fabricaci&oacute;n de por vida.</li>\r\n	<li>Mant&eacute;ngase alejado de ni&ntilde;os ya que las navajas se mantienen afiladas por m&aacute;s de 100,000 cortes\r\n	<p>&nbsp;</p>\r\n	</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '139.00', '180.00', 'MXN', 'no', 'no', 12, 1, 1, 'No disponible para la venta', '2019-08-02 18:50:28', '2019-08-02 18:50:28', '2019-08-02 18:50:28', '12.70', '12.70', '20.30', '0.30', '0.20', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(3, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Pinzas de acero inoxidable para alimentos. ', 'pinzas-para-alimentos', '<ul>\r\n	<li>Pinza para alimentos de acero inoxidable de 28 cent&iacute;metros de largo, ideales para el manejo de alimentos calientes o para servir las ensaladas.</li>\r\n	<li>Dise&ntilde;adas con puntas de silic&oacute;n grado alimenticio resistente a altas temperaturas y con un arillo&nbsp;en la parte superior que sirve como seguro, al jalarlo las pinzas se cierran y no se vuelven a abrir.</li>\r\n	<li>Sus costados est&aacute;n&nbsp;recubiertos con silic&oacute;n lo que le da una mejor precisi&oacute;n de agarre a tus manos.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>F&aacute;ciles de almacenar sin&nbsp;nada de complicaciones al sacarlas del caj&oacute;n.&nbsp;</li>\r\n	<li>Sus costados est&aacute;n&nbsp;recubiertos con silic&oacute;n lo que le da un excelente agarre.&nbsp;</li>\r\n	<li>Sus caracter&iacute;sticas&nbsp;las hacen un utensilio&nbsp;sobresaliente en la cocina, para mezclar ensaladas, voltear carnes y transferir pasta o vegetales.&nbsp;</li>\r\n	<li>Miden 28 cm de largo.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '109.00', '139.00', 'MXN', 'no', 'no', 33, 1, 1, 'No disponible para la venta', '2019-08-01 01:08:40', '2019-08-01 01:08:40', '2019-08-01 01:08:40', '4.00', '4.00', '27.50', '0.25', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(4, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Reloj para caballero  Mitaki-Japan®. ', 'reloj-para-caballero', '<p>Reloj deportivo digital para hombre marca Mitaki-Japan&reg;</p>\r\n', '<ul>\r\n	<li>\r\n	<h3>Excelente reloj para usarlo cuando haces ejercicio o en un d&iacute;a informal.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Sus caracter&iacute;sticas principales incluyen funci&oacute;n de fecha, alarma, se ilumina al marcarse la hora y luz.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Su resistente banda de poliuretano es hipoalerg&eacute;nica y de alta resistencia.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Un bonito regalo para un hombre activo.&nbsp;</h3>\r\n	</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '279.00', '0.00', 'MXN', 'no', 'no', 2, 1, 1, 'No disponible para la venta', '2019-08-02 18:55:06', '2019-08-02 18:55:06', '2019-08-02 18:55:06', '2.00', '5.00', '181.00', '0.19', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(5, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Siempre puntual con el Reloj digital deportivo para caballero marca Mitaki-Japan® modelo Super. Importado de USA. ', 'reloj-para-caballero-rcx', '<ul>\r\n	<li>Pr&aacute;ctico y resistente reloj digital para caballero de la marca Mitaki-Japan&reg;, tu compa&ntilde;ero ideal para hacer ejercicio todos los d&iacute;as.</li>\r\n	<li>Este excelente reloj cuenta con funciones de luz, cronometro y fecha.</li>\r\n	<li>Resistente al agua hasta los 30 metros.</li>\r\n	<li>Producto importado de Estados Unidos.&nbsp;</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Tu compa&ntilde;ero ideal para hacer ejercicio todos los d&iacute;as.</li>\r\n	<li>Muy liviano y resistente.&nbsp;</li>\r\n	<li>Color gris con extensible color negro.&nbsp;</li>\r\n	<li>Car&aacute;tula grande.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '179.00', '380.00', 'MXN', 'no', 'no', 1, 1, 1, 'No disponible para la venta', '2019-08-02 18:51:15', '2019-08-02 18:51:15', '2019-08-02 18:51:15', '5.00', '2.00', '18.00', '0.21', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(6, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Reloj para dama  Mitaki-Japan® Ladies\' Digital Sport Watch. Importado de USA. ', 'reloj-para-dama', '<ul>\r\n	<li>Para el ejercicio diario, te traemos este pr&aacute;ctico y c&oacute;modo reloj deportivo digital de la marca Mitaki-Japan&reg;. Util&iacute;zalo para ir al gimnasio, a correr e incluso a nadar ya que es resistente al agua.</li>\r\n	<li>Este excelente reloj incluye funciones de fecha, luz y alarma.</li>\r\n	<li>Dise&ntilde;o muy femenino.&nbsp;</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Este excelente reloj incluye funciones de fecha, luz y alarma.</li>\r\n	<li>Dise&ntilde;o muy femenino.&nbsp;</li>\r\n	<li>Ideal para ir a correr, al gimnasio o para practicar tu deporte favorito.&nbsp;</li>\r\n	<li>Es resistente al agua hasta los 30 metros de profundidad.</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '179.00', '259.00', 'MXN', 'no', 'no', 2, 1, 1, 'No disponible para la venta', '2019-08-02 17:53:47', '2019-08-02 17:53:47', '2019-08-02 17:53:47', '1.00', '5.00', '18.00', '0.25', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(7, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Vaso termo. Lleva tu bebida contigo a donde vayas. Importado de USA.', 'vaso-termo', '<ul>\r\n	<li>Vaso t&eacute;rmico para que tu bebida viaje contigo a cualquier lado.</li>\r\n	<li>Esta dise&ntilde;ado con de doble pared y tapa transparente.</li>\r\n	<li>Fabricado&nbsp;con acero inoxidable 18/8 que es el material m&aacute;s utilizado para utensilios de cocina y productos en contacto con alimentos.</li>\r\n	<li>Capacidad 473 ml.</li>\r\n	<li>Mantiene la temperatura de tus bebidas por horas.</li>\r\n	<li>Producto importado de Estados Unidos.&nbsp;</li>\r\n</ul>\r\n', '<ul>\r\n	<li>\r\n	<h3>Vaso de acero inoxidable 18/8 ideal para usarse en productos que contienen alimentos.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Resistente a la corrosi&oacute;n.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>No permite que se escape el calor o que penetre y es muy resistente a las altas temperaturas.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Debido a su&nbsp;doble capa de aislamiento es posible que las bebidas se mantengan calientes o fr&iacute;as por horas sin importar el clima exterior.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>No transfiere olores o sabores a la bebida.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Su tapa transparente permite ver a trav&eacute;s de ella sin tener que abrir el vaso.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Tapa a prueba de fugas y derrames.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Capacidad de 473 mililitros.</h3>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '280.00', '360.00', 'MXN', 'no', 'no', 2, 1, 1, 'No disponible para la venta', '2019-09-02 22:59:31', '2019-09-02 22:59:31', '2019-09-02 22:59:31', '7.00', '18.50', '0.00', '0.50', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(8, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Botella de vidrio con protección antiderrapante. Importado de USA. Envío gratis. ', 'botella-de-vidrio-con-proteccion', '<ul>\r\n	<li>Botella de vidrio con cubierta de silic&oacute;n y tapa abatible.</li>\r\n	<li>Su recubrimiento de silic&oacute;n lo hace m&aacute;s seguro al agarre y m&aacute;s resistente contra el impacto en caso de ca&iacute;das.&nbsp;</li>\r\n	<li>Tapa con&nbsp;un empaque de silic&oacute;n a prueba de fugas y derrames.</li>\r\n	<li>Capacidad de 532&nbsp;mililitros, 18 oz.&nbsp;</li>\r\n	<li>Producto importado de Estados Unidos.&nbsp;</li>\r\n	<li>Env&iacute;o gratis.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Botella de vidrio 100% reciclable, para ti que buscas reducir tu consumo de pl&aacute;sticos.</li>\r\n	<li>Sin qu&iacute;micos ni sustancias que liberen sabores y olores desagradables a las bebidas.&nbsp;</li>\r\n	<li>La tapa tiene un empaque de silic&oacute;n a prueba de fugas y derrames.&nbsp;</li>\r\n	<li>Su recubrimiento de silic&oacute;n lo hace m&aacute;s seguro al agarre y m&aacute;s resistente contra el impacto en caso de ca&iacute;das.&nbsp;</li>\r\n	<li>F&aacute;cil de lavar. NO apta para lavavajillas.&nbsp;</li>\r\n	<li>Capacidad de 532&nbsp;mililitros, 18 oz.&nbsp;</li>\r\n	<li>Env&iacute;o gratis con Correos de M&eacute;xico.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '299.00', '360.00', 'MXN', 'no', '3', 1, 1, 1, 'No disponible para la venta', '2019-09-02 22:56:48', '2019-09-02 22:56:48', '2019-09-02 22:56:48', '0.00', '0.00', '0.00', '0.80', '0.63', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(9, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Termo con recubrimiento para máximo agarre. Importado de USA. ', 'termo-con-recubrimiento-de-agarre', '<ul>\r\n	<li>El vaso esta totalmente hecho de acero inoxidable 18/8 lo que lo hace altamente resistente a la corrosi&oacute;n.</li>\r\n	<li>Practico termo de doble pared que permite mantener la temperatura de tus l&iacute;quidos hasta por 8 horas.</li>\r\n	<li>Ideal para trasladar tus l&iacute;quidos sin derrames.</li>\r\n	<li>Con su envoltura de silic&oacute;n es muy f&aacute;cil de sujetarla.</li>\r\n	<li>Capacidad de 532 mililitros, 18 oz.&nbsp;</li>\r\n	<li>Producto importado de Estados Unidos.&nbsp;</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Esta botella de doble pared mantiene tus bebidas favoritas calientes o fr&iacute;as durante horas.</li>\r\n	<li>Con su envoltura de silic&oacute;n es muy f&aacute;cil de sujetarla, mientras que su tapa abre f&aacute;cil permite que abrirla y cerrarla sea pan comido.</li>\r\n	<li>El vaso esta totalmente hecho de acero inoxidable 18/8 lo que lo hace altamente resistente a la corrosi&oacute;n y f&aacute;cil de limpiar.</li>\r\n	<li>No tendr&aacute;s que preocuparte por olores desagradables o sabores que queden impregnados.</li>\r\n	<li>Olv&iacute;date de las botellas de pl&aacute;stico.&nbsp;</li>\r\n	<li>Capacidad de 532 mililitros, 18 oz.&nbsp;</li>\r\n</ul>\r\n\r\n<pre>\r\n\r\n&nbsp;</pre>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '279.00', '0.00', 'MXN', 'no', 'no', 2, 1, 1, 'No disponible para la venta', '2019-09-02 22:57:15', '2019-09-02 22:57:15', '2019-09-02 22:57:15', '7.00', '22.00', '0.00', '0.50', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(13, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Infusor para té en forma de fresa', 'infusor-para-te-en-forma-de-fresa', '<ul>\r\n	<li>Si los infusores de acero son demasiado aburridos para ti, nuestro infusor en forma de fresa ser&aacute; tu opci&oacute;n favorita de ahora en adelante.</li>\r\n	<li>Agrega sabor y color a tus jornadas laborales con un t&eacute; reci&eacute;n hecho en un divertido infusor.&nbsp;&nbsp;</li>\r\n	<li>Con el tama&ntilde;o exacto, este infusor puede ser utilizado con t&eacute; de hoja, cualquier hierba arom&aacute;tica o tizanas.</li>\r\n	<li>Solo rellena la fresa con tu hierba favorita, ci&eacute;rrala. Col&oacute;cala en una taza y agrega agua&nbsp;a punto de hervir. Espera de 3 a 4 minutos y listo.</li>\r\n	<li>La fresa est&aacute; hecha de silic&oacute;n grado alimenticio, totalmente seguro para utilizarse con alimentos y bebidas.</li>\r\n	<li>Su tama&ntilde;o es perfecto y sus poros permiten que todo el sabor de tus hierbas salga, sin permitir que&nbsp;se escape.</li>\r\n	<li>No deja ning&uacute;n sabor ni olor en tu bebida.</li>\r\n	<li>Ligero y pr&aacute;ctico. Puedes llevarlo contigo a todos lados y&nbsp;disfrutar de tu bebida favorita aunque est&eacute;s lejos de casa.</li>\r\n	<li>F&aacute;cil de lavar, solo debes usar jab&oacute;n y enjuagar con suficiente agua.</li>\r\n	<li>No te quedes sin disfrutar de tu t&eacute; favorito a donde quiera que vayas.&nbsp;</li>\r\n</ul>\r\n\r\n<p>Te queremos consentir, <em>ll&eacute;vate 2 fresas por tan solo $138.70 &oacute; 3 fresas por $201.48.&nbsp;</em></p>\r\n', '<ul>\r\n	<li>Ligero, durable, f&aacute;cil de usar y lavar.</li>\r\n	<li>Es el regalo ideal para los amantes del t&eacute;.&nbsp;</li>\r\n	<li>Con un lindo dise&ntilde;o en forma de fresa que puedas rellenar totalmente para disfrutar la concentraci&oacute;n perfecta para ti.&nbsp;</li>\r\n	<li>Fabricado con silic&oacute;n grado alimenticio, este infusor es totalmente adecuado para su uso en alimentos.</li>\r\n	<li>No desprender&aacute; sabores en el agua y es muy f&aacute;cil de lavar.</li>\r\n	<li>M&aacute;s f&aacute;cil de lavar que un infusor met&aacute;lico.</li>\r\n	<li>Es un adecuado compa&ntilde;ero en las largas horas laborales o en los viajes de fin de semana.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '73.00', '85.00', 'MXN', 'no', 'no', 18, 1, 1, 'No disponible para la venta', '2019-07-29 19:17:45', '2019-07-29 19:17:45', '2019-07-29 19:17:45', '5.00', '6.00', '2.00', '0.14', '0.04', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(14, '5c9c1ff62ce0c3.78174962', 1, 'Infusor de té en forma de T. rex, una divertida manera de preparar tu té. ', 'Divertido infusor de té en forma de dinosaurio. Perfecto para preparar tus infusiones de hoja seca o tizanas. Muy fácil de usar y de lavar. El regalo ideal para los amantes de los reptiles. ', 'Infusor de té, infusor de dinosaurio, infusor en forma de T-rex, infusores de silicón, infusor té de hoja suelta, tizanas, ', 'Prehistórico infusor de té en forma de T. rex', 'infusor-de-té-en-forma-de-t-rex', '<ul>\r\n	<li>Desde el per&iacute;odo Cret&aacute;cico&nbsp;llega hoy este T. rex para animar la forma en la que preparas tus t&eacute;s o infusiones.</li>\r\n	<li>Colorido y divertido, este dinosaurio es perfecto para preparar t&eacute; de hoja suelta, infusiones de hierbas arom&aacute;ticas o tizanas.&nbsp;</li>\r\n	<li>Solo tienes que separar la cabeza, rellenar todo el cuerpo del T. rex, introducirlo en una taza y agregar agua a punto de hervir. En unos cuantos minutos tu bebida favorita estar&aacute; lista para disfrutarse.&nbsp;</li>\r\n	<li>Fabricado con un silic&oacute;n especial, este verde amigo es ideal para usarse con bebidas.&nbsp;</li>\r\n	<li>No deja olores ni sabores.&nbsp;</li>\r\n	<li>F&aacute;cil de usar y muy sencillo de lavar. Solo usa tu jab&oacute;n regular y enjuaga con abundante agua.&nbsp;</li>\r\n	<li>De hoy en adelante la hora del t&eacute; tendr&aacute; un color diferente.&nbsp;</li>\r\n</ul>\r\n\r\n<p>No te quedes sin hacer feliz a un amigo. Solo por un par de semanas te ofrecemos 2 dinosaurios por tan solo $212.80.</p>\r\n', '<ul>\r\n	<li>Fabricado con silic&oacute;n grado alimenticio, este verde amigo es una opci&oacute;n refrescante para preparar tu t&eacute; todos los d&iacute;as.</li>\r\n	<li>Puedes llenar el cuerpo y la cabeza para obtener la concentraci&oacute;n que m&aacute;s te gusta.</li>\r\n	<li>Resistente, durable y f&aacute;cil de lavar.&nbsp;</li>\r\n	<li>Ponle una nueva cara a tus ma&ntilde;anas y rel&aacute;jate tomando tu t&eacute; matinal.</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '112.00', '128.00', 'MXN', 'no', 'no', 25, 1, 1, 'No disponible para la venta', '2019-08-19 19:04:45', '2019-08-19 19:04:45', '2019-08-19 19:04:45', '4.00', '7.00', '4.00', '0.10', '0.06', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(15, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Divertidos marcadores para copas de emojis', 'marcadores-para-vaso-o-copas-de-emojis', '<ul>\r\n	<li>Set de 8 divertidos marcadores para copas de emojis.&nbsp;</li>\r\n	<li>Se usan marcar tus copas durante tus fiestas y as&iacute; no correr&aacute;s el riesgo de que alguien se tome tu bebida.</li>\r\n	<li>S&oacute;lo marca tu copa y disfruta de la fiesta.&nbsp;</li>\r\n	<li>Son ocho diferentes dise&ntilde;os, ligeros, y se adhiere a botellas, vasos y copas de vidrio.</li>\r\n	<li>F&aacute;ciles de usar y lavar.&nbsp;&nbsp;</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Divertidos&nbsp;emojis para marcar tus copas durante tus fiestas.</li>\r\n	<li>No correr&aacute;s m&aacute;s el riesgo de que alguien se tome tu bebida, solo marca tu copa y disfruta de la fiesta.&nbsp;</li>\r\n	<li>Ocho diferentes dise&ntilde;os, ligeros, y se adhiere a botellas, vasos y copas de vidrio.</li>\r\n	<li>F&aacute;ciles de usar y lavar.&nbsp;&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '164.00', '214.00', 'MXN', 'no', 'no', 25, 1, 1, 'No disponible para la venta', '2019-08-06 00:10:57', '2019-08-06 00:10:57', '2019-08-06 00:10:57', '3.00', '2.00', '2.00', '0.07', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(21, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Joyero de madera hecho a mano', 'joyero-de-madera-hecho-a-mano', '<ul>\r\n	<li>Hermoso&nbsp;joyero de madera de pino hecho a mano con dimensiones de 17 x 13 x 18 cent&iacute;metros.</li>\r\n	<li>Elaborado por un joven artesano veracruzano.&nbsp;</li>\r\n	<li>Su cerradura es&nbsp;totalmente funcional.</li>\r\n	<li>Incluye dos llaves.&nbsp;</li>\r\n	<li>Terminado natural para que pueda ser personalizado o decorado al gusto.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '<ul>\r\n	<li>﻿﻿Esta linda caja de madera esta totalmente hecha a mano en madera de pino por un artesano veracruzano.</li>\r\n	<li>El trabajo se encuentra perfectamente detallado y los acabados muy bien cuidados.</li>\r\n	<li>La cerradura es de primera calidad y es totalmente funcional.</li>\r\n	<li>Incluye dos llaves.&nbsp;</li>\r\n	<li>Gracias a su terminado natural es posible decorarlo o pintarlo al gusto de la persona.</li>\r\n	<li>Deje que sus ni&ntilde;as lo personalicen y creen un lugar privado en donde guardar sus secretos.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'México', 'si', '', '', '', '', '', '', '160.00', '240.00', 'MXN', 'no', 'no', 10, 1, 1, 'No disponible para la venta', '2019-08-28 21:59:02', '2019-08-28 21:59:02', '2019-08-28 21:59:02', '17.50', '13.00', '18.00', '1.20', '1.06', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(22, '5d0ab3549fe593.01622310', 9, 'Juego de tapas de silicón multiusos, reutilizables para todas tus ollas y tuppers. ', 'Tapas que se ajustan a todos los tamaños, formas y superficies. Son muy elásticas y resistentes. Reutilizables. Fáciles de lavar y almacenar. ', 'tapas de silicón para alimentos, tapas elásticas, tapas reutilizables de silicón, tapas ecológicas, tapas de silicón multiusos, tapas multiusos, ', 'Mantén todo tapado con este set de 6 piezas de tapas de silicón elásticas ideal para cualquier olla o contenedor. ', 'tapas-de-silicón', '<ul>\r\n	<li>Pr&aacute;cticas y resistentes tapas de silic&oacute;n para conservar tus alimentos por mayor tiempo en el refrigerador.</li>\r\n	<li>Set de 6 piezas de 20 cm, 17 cm, 15 cm, 12 cm, 10 cm y 6.5 cm. Ideales para cubrir cualquier recipiente.&nbsp;</li>\r\n	<li>Sellan herm&eacute;ticamente lo que hace imposible que haya un derrame accidental</li>\r\n	<li>Pueden usarse para cubrir frutas y verduras directamente ya que son muy manejables y suaves.&nbsp;</li>\r\n	<li>Mantienen los alimentos frescos dentro y fuera del refrigerador.&nbsp;</li>\r\n	<li>F&aacute;cil de usar y lavar.&nbsp;</li>\r\n	<li>Totalmente seguro para uso con alimentos ya que es un material no da&ntilde;ino, que no libera ning&uacute;n tipo de gas, olor o residuo.</li>\r\n	<li>Libres de BPA&nbsp;y plomo.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '<ul>\r\n	<li>\r\n	<p>Aprobado por la FDA.</p>\r\n	</li>\r\n	<li>\r\n	<p>Totalmente reutilisables.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Ideales para cubrir cualquier recipiente.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Puedes usarlas para cubrir tus alimentos si estas en un d&iacute;a de campo o mientras viajas.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Pueden usarse para cubrir frutas y verduras directamente ya que son muy manejables y suaves.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Mantienen los alimentos frescos dentro y fuera del refrigerador.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>F&aacute;cil de usar y lavar.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Vienen en tres diferentes grados de resistencia, para que todos en la familia puedan usarlas f&aacute;cilmente.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>La calidad del producto esta relacionada con su peso en gramos. A mayor cantidad de gramos mayor calidad, resistencia&nbsp;y durabilidad.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>No tienes que preocuparte por comprar un sin numero de tapas, gracias a su elasticidad puedes usarlas sobre pr&aacute;cticamente cualquier olla, sart&eacute;n o refractario.&nbsp;</p>\r\n	</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '140.00', '190.00', 'MXN', 'no', 'no', 45, 1, 1, 'No disponible para la venta', '2019-08-19 18:00:06', '2019-08-19 18:00:06', '2019-08-19 18:00:06', '19.00', '3.00', '3.00', '0.38', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(24, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Cartucho de carbón activado para filtros encima del fregadero', 'cartucho-de-fibra-de-coco', '<p>Cartucho de fibra de coco para filtros sobre el fregadero.</p>\r\n', '<ul>\r\n	<li>Cartucho de carb&oacute;n activado fabricado 100% con fibra de coco, uno de los mejores materiales para purificaci&oacute;n de agua.&nbsp;</li>\r\n	<li>Entrada universal para cualquier filtro que vaya encima del fregadero.&nbsp;</li>\r\n	<li>Con capacidad de filtraci&oacute;n hasta por 6 meses.&nbsp;</li>\r\n	<li>Excelente calidad.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '20.00', '0.00', 'USD', 'no', 'no', 99, 1, 1, 'No disponible para la venta', '2019-08-29 00:51:36', '2019-08-29 00:51:36', '2019-08-29 00:51:36', '7.00', '25.00', '10.50', '0.55', '0.40', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(25, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Cartucho de carbón activado para filtros sobre y bajo el fregadero', 'cartucho-royal', 'Cartucho para filtros sobre y debajo del fregadero. ', '<p>Repuesto de cartucho para filtro sobre y debajo del fregadero. Ideal para los filtros Eclipse y Royal. Cuerpo de carbon activado de la mejor calidad.&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '100.00', '0.00', 'USD', 'no', 'no', 49, 1, 1, 'No disponible para la venta', '2019-06-03 21:52:32', '2019-07-24 17:53:10', '2019-06-03 21:52:32', '12.00', '20.00', '1.00', '1.00', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'inactivo', 1),
(26, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Manguera con válvula para filtro sobre el fregadero', 'manguera-con-válvula-para-filtro-sobre-el-fregadero', 'Válvula y manguera para filtro encima del fregadero. ', '<p>V&aacute;lvula y manguera de respuesto para los filtros de agua instalados arriba del fregadero. La v&aacute;lvula est&aacute; fabricada en acero inoxidable y la manguera es de alta calidad, con un metro de longitud para facilitar el acomodo del filtro en cualquier area del fregadero.&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '35.00', '0.00', 'USD', 'no', 'no', 1, 1, 1, 'No disponible para la venta', '2019-07-05 17:50:11', '2019-07-05 17:50:11', '2019-07-05 17:50:11', '0.00', '0.00', '0.00', '0.50', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'inactivo', 1),
(27, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Set de 4 tazas para medir alimentos marca Chef\'s Secret® en acero inoxidable. Importado de USA. ', 'chefs-secret-4pc-t304-stainless-steel-measuring-cup-set', '<ul>\r\n	<li>Pr&aacute;ctico set de 4 tazas para medici&oacute;n de alimentos.</li>\r\n	<li>Con estas tazas medidoras tendr&aacute;s el control total para preparar esos exquisitos platillos que a tu familia les encantan.</li>\r\n	<li>Su uso evitar&aacute; que est&eacute;s adivinando si estas usando la cantidad correcta de tus ingredientes al preparar tus recetas favoritas.</li>\r\n	<li>Este set viene con un anillo para mantener las tazas juntas.</li>\r\n	<li>Los mangos&nbsp;est&aacute;n soldados al cuerpo de la taza por lo que no existe riesgo que se desprendan.</li>\r\n	<li>La capacidad de cada taza, 1 taza, 1/2 taza, 1/3 taza y 1/4 taza.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>El exterior presenta un acabado espejo mientras que el interior es satinado.</li>\r\n	<li>Tenemos dos modelos:\r\n	<ul>\r\n		<li>Mango liso con la cantidad grabada&nbsp;en el mango, claramente visible.&nbsp;</li>\r\n		<li>Mango tubular con la cantidad grabada en el costado de la taza.&nbsp;</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '379.00', '420.00', 'MXN', 'no', 'no', 1, 1, 1, 'No disponible para la venta', '2019-08-02 18:44:08', '2019-08-02 18:44:08', '2019-08-02 18:44:08', '6.00', '6.00', '15.00', '0.38', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(28, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Divertidas moldes para hotcakes o huevo', 'divertidas-moldes-para-hotcakes-o-huevo', '<ul>\r\n	<li>Convierte tu desayuno en una obra de arte con estos moldes para huevo o hotcakes.</li>\r\n	<li>Set con forma de b&uacute;ho, conejo y sol con nube. Tres divertidas opciones para cambiarle la cara al desayuno de los peque&ntilde;os de la casa</li>\r\n	<li>Elaborados con silic&oacute;n grado alimenticio. Totalmente seguro para utilizarse con alimentos.</li>\r\n	<li>Basta con colocarlos sobre un sart&eacute;n, a&ntilde;adir los huevos o la masa en los anillos y esperar a que tengan el punto de cocci&oacute;n adecuado. Retira cuidadosamente y ya est&aacute;, una linda forma de decorar tu desayuno.&nbsp;</li>\r\n</ul>\r\n\r\n<p>Y para que la diversi&oacute;n alcance para todos te ofrecemos 2 sets por $207.1 &oacute; 3 sets por $300.84.</p>\r\n', '<ul>\r\n	<li>Empieza tu d&iacute;a&nbsp;con un desayuno divertido y nutritivo.</li>\r\n	<li>Crea hotcakes&nbsp;o huevos con diferentes temas y figuras.&nbsp;</li>\r\n	<li>Moldes hechos de silic&oacute;n resistente al calor, f&aacute;cil de usar y de lavar. Completamente&nbsp;seguros para utilizarlos con alimentos.&nbsp;</li>\r\n	<li>Contiene 3 moldes,&nbsp;&nbsp;sol con nube, conejo y b&uacute;ho.</li>\r\n	<li>Regala un rato de diversi&oacute;n a tus peque&ntilde;os o consciente con un lindo detalle a esa persona especial.&nbsp;</li>\r\n</ul>\r\n\r\n<p><br />\r\n<br />\r\n&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '109.00', '129.00', 'MXN', 'no', 'no', 30, 1, 1, 'No disponible para la venta', '2019-08-01 00:32:41', '2019-08-26 18:55:28', '2019-08-01 00:32:41', '10.00', '11.00', '1.50', '0.48', '0.38', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(29, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Y para los que disfrutan hacer postres en casa: Juego de espátula para mezcla y 12 moldes para hornear', 'espatula-para-mezcla-y-capacetes-para-hornear', '<ul>\r\n	<li>El regalo perfecto para todos los que gustan de los postres hechos en casa.&nbsp;</li>\r\n	<li>&nbsp;El set cuenta con: una esp&aacute;tula para mezcla de 21 cm y 12 moldes de&nbsp;silic&oacute;n&nbsp;de 6.5 cm de di&aacute;metro por 3 cm de alto</li>\r\n	<li>Los moldes est&aacute;n fabricados de silic&oacute;n de alta calidad ideales para hornear.</li>\r\n	<li>Puedes preparar panques, gelatinas, mousse, helado, chocolates o chesse cakes.&nbsp;</li>\r\n	<li>F&aacute;ciles de desmoldar y de limpiar.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '<ul>\r\n	<li>Los moldes son re-usables, esto&nbsp;evita generar mas basura y reforzar tu consciencia ecol&oacute;gica.</li>\r\n	<li>Miden aproximadamente 6.5 cm de di&aacute;metro por 3 cm de alto.&nbsp;</li>\r\n	<li>Una gran alternativa para hornear sin tener que utilizar moldes de papel.</li>\r\n	<li>F&aacute;ciles de desmoldar y de limpiar.&nbsp;</li>\r\n	<li>Incluye una esp&aacute;tula de 21.5 cm de largo fabricada con silic&oacute;n grado alimenticio.&nbsp;</li>\r\n	<li>Este juego es el regalo perfecto para los amantes de preparar en casa sus propios postres.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '121.00', '150.00', 'MXN', 'no', 'no', 35, 1, 1, 'No disponible para la venta', '2019-08-01 01:07:09', '2019-08-01 01:07:09', '2019-08-01 01:07:09', '0.00', '0.00', '0.00', '0.38', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(30, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Set de esponja de silicón y embudo plegable', 'esponja-de-silicona-para-trastos-y-embudo-plegable', '<ul>\r\n	<li>Set de esponja de silicon de 11 cm de di&aacute;metro y embudo cuadrado plegable de 7.5 cm.</li>\r\n	<li>Ideal para jarras de vidrio, vasos, art&iacute;culos delicados&nbsp;y sartenes recubiertas.&nbsp;</li>\r\n	<li>Hecho de silicon aprobado para usarse con alimentos. No es poroso lo que previene malos olores y crecimiento de bacterias.&nbsp;</li>\r\n	<li>El embudo plegable de 7.5 cm de di&aacute;metro.&nbsp;</li>\r\n	<li>Evita esas luchas contra el caj&oacute;n. Ocupa un espacio peque&ntilde;o y jam&aacute;s se atorar&aacute; al intentar sacarlo del caj&oacute;n.&nbsp;</li>\r\n	<li>Colores variados.</li>\r\n	<li>Seguras para lavavajillas.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>﻿﻿&nbsp;Esponja multifuncional&nbsp;de 11 cent&iacute;metros para lavar platos y utensilios&nbsp;de cocina.&nbsp;</li>\r\n	<li>Ideal para jarras de vidrio, vasos, art&iacute;culos delicados&nbsp;y sartenes recubiertas.&nbsp;</li>\r\n	<li>Hecho de silicon aprobado para usarse con alimentos. No es poroso lo que previene malos olores y crecimiento de bacterias.&nbsp;</li>\r\n	<li>Suave, no deja marcas.&nbsp;</li>\r\n	<li>Es&nbsp;muy flexible, lo que permite&nbsp;alcanzar espacios reducidos como esquinas de moldes, vasos y copas.</li>\r\n	<li>Art&iacute;culo 100% garantizado.&nbsp;</li>\r\n	<li>El embudo plegable de 7.5 cm de di&aacute;metro.&nbsp;</li>\r\n	<li>Evita esas luchas contra el caj&oacute;n. Ocupa un espacio peque&ntilde;o y jam&aacute;s se atorar&aacute; al intentar sacarlo del caj&oacute;n.&nbsp;</li>\r\n	<li>Es ideal para transferir l&iacute;quidos y/o s&oacute;lidos como harinas y az&uacute;car. Totalmente seguro para utilizarlo con alimentos y bebidas.&nbsp;</li>\r\n	<li>Colores variados.</li>\r\n	<li>Seguras para lavavajilla.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '104.00', '184.00', 'MXN', 'no', 