(33, '5c9c1ff62ce0c3.78174962', 1, 'Palomero para microondas, la forma rápida y sana de preparar palomitas en casa.', 'Es la forma más rápida y sana de preparar palomitas en casa, sin aceite, mantequilla o grasa. Solo agrega maíz palomero, mételo en el microondas y en menos de 4 min. disfruta de tus palomitas.  ', 'palomero para microondas, palomitas en el microondas, palomitas saludables, palomitas hechas en casa, ', '¿Cine en casa? ¿Te gustan las palomitas pero te desagrada prepararlas en la estufa? Tenemos la solución perfecta para ti con este fabuloso palomero para microondas.', 'recipiente-para-hacer-palomitas-en-el-microondas', '<ul>\r\n	<li>Palomero&nbsp;para microondas.&nbsp;</li>\r\n	<li>Solo agrega el grano de ma&iacute;z de tu preferencia e introduce el recipiente en el microondas.&nbsp;</li>\r\n	<li>Dependiendo de la potencia de tu horno selecciona aproximadamente 3 minutos y listo!. Palomitas listas en poco tiempo,&nbsp;&nbsp;sin grasa y sin esperar a que todos los ma&iacute;ces abran.&nbsp;</li>\r\n	<li>Un excelente regalo para cin&eacute;filos y amantes de las palomitas caseras.&nbsp;</li>\r\n	<li>Muy f&aacute;cil de lavar.&nbsp;</li>\r\n	<li>Se pliega y ocupa muy poco espacio de almacenaje.&nbsp;</li>\r\n	<li><strong>PRECAUCI&Oacute;N.&nbsp;&iexcl;Ten Cuidado! Espera un par de minutos antes de sacar el molde ya que su temperatura es muy alta al momento de que las palomitas est&aacute;n listas.</strong>&nbsp;</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Ahora es muy f&aacute;cil hacer palomitas en casa, solo desdobla, agrega&nbsp;cualquier tipo de ma&iacute;z&nbsp;palomero, tu saborizante favorito y listo.</li>\r\n	<li>Coloca el recipiente por 3&nbsp;minutos (dependiendo de tu horno de microondas) en el microondas podr&aacute;s disfrutar de unas ricas y nutritivas palomitas.&nbsp;&nbsp;</li>\r\n	<li>Producto durable y seguro.&nbsp;</li>\r\n	<li>Muy f&aacute;cil de lavar y almacenar.&nbsp;</li>\r\n	<li>Se pliega ocupando menos de la mitad de su tama&ntilde;o.&nbsp;</li>\r\n	<li>Producto durable y seguro.&nbsp;</li>\r\n	<li>Muy f&aacute;cil de lavar y almacenar.&nbsp;</li>\r\n	<li>Se pliega ocupando menos de la mitad de su tama&ntilde;o.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '148.00', '198.00', 'MXN', 'no', 'no', 35, 1, 1, 'No disponible para la venta', '2019-08-19 17:28:01', '2019-08-19 17:28:01', '2019-08-19 17:28:01', '20.00', '15.00', '0.00', '0.60', '0.50', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(34, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Y para que la fuerza te acompañe: Set de moldes para hielo de Star wars.', 'set-de-moldes-para-hielo-de-star-wars', '<ul>\r\n	<li>Juego de 8 bandejas&nbsp;de silicona Star Wars: Stormtrooper, Darth Vader, X-Wing Fighter, Millennium Falcon, R2-D2, Han Solo, Boba Fett, y Death Star.</li>\r\n	<li>Moldes fabricados en 100% silic&oacute;n de alta calidad totalmente aprobada para uso en alimentos.&nbsp;</li>\r\n	<li>Resistentes al frio&nbsp;y al calor.&nbsp;Pueden usarse en el congelador para hacer hielos, en el refrigerador para hacer gelatinas o con l&iacute;quidos calientes como chocolates.&nbsp;</li>\r\n	<li>Excelente opci&oacute;n para que los ni&ntilde;os pasen un rato muy divertido al realizar sus gelatinas o chocolates con sus figuras favoritas.</li>\r\n	<li>Los fan&aacute;ticos de Star Wars quedar&aacute;n encantados con este genial producto.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Moldes fabricados en 100% silic&oacute;n de alta calidad totalmente aprobada para uso en alimentos.&nbsp;</li>\r\n	<li>Excelentes para usarlos en el congelador para hacer hielos, o en refrigerador para unas divertidas gelatinas.&nbsp;</li>\r\n	<li>Puedes tambi&eacute;n hacer chocolates, caramelos e incluso velas.&nbsp;</li>\r\n	<li>Resistentes al congelador y al calor.&nbsp;</li>\r\n	<li>8 Diferentes colores y figuras de personajes de esta exitosa saga.&nbsp;</li>\r\n	<li>Son el regalo perfecto para personas de cualquier edad y un regalo obligado para aquellos amantes de Star Wars.&nbsp;</li>\r\n	<li>Los ni&ntilde;os pasaran un rato muy divertido al realizar sus gelatinas o chocolates con sus figuras favoritas.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '289.00', '499.00', 'MXN', 'no', 'no', 33, 1, 1, 'No disponible para la venta', '2019-08-01 00:33:57', '2019-08-01 00:33:57', '2019-08-01 00:33:57', '20.00', '10.00', '20.00', '0.86', '0.71', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(35, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Encantador infusor de té en forma de buzo', 'infusor-de-té-en-forma-de-buzo', '<ul>\r\n	<li>Si eres amante de las infusiones, t&eacute;s y tizanas, este amigo te llevar&aacute; a explorar las profundidades del sabor.&nbsp;</li>\r\n	<li>Ideal para utilizarse con cualquier t&eacute; de hoja o hierba arom&aacute;tica.&nbsp;</li>\r\n	<li>Simplemente llena el cuerpo del buzo con la cantidad que prefieras, col&oacute;calo en una taza, agrega agua caliente a punto de hervir, espera 4 minutos y ya est&aacute;, tu bebida favorita a la concentraci&oacute;n perfecta.&nbsp;</li>\r\n	<li>Fabricado con silic&oacute;n grado alimenticio, este aventurero amigo no deja sabores, olores o residuos en tu bebida. El silic&oacute;n es totalmente seguro para ser utilizado con alimentos y bebidas.&nbsp;</li>\r\n	<li>Sus poros tienen el tama&ntilde;o exacto para que se libere todo el sabor de las hojas pero no pase ning&uacute;n trozo de ellas a tu taza.&nbsp;</li>\r\n	<li>F&aacute;cil de lavar, solamente tienes que limpiarlo&nbsp;con jab&oacute;n y enjuagar con abundante agua.&nbsp;</li>\r\n	<li>No te pierdas la oportunidad de llegar a lo m&aacute;s profundo del sabor preparando tu t&eacute; con este valiente compa&ntilde;ero.&nbsp;</li>\r\n	<li>Colores variados en cada entrega.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; OFERTA DE INTRODUCCI&Oacute;N</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; LL&Eacute;VATE 2 BUZOS POR $212.80 O 3 BUZOS POR 309.12.</strong></p>\r\n', '<ul>\r\n	<li>Este aventurero amigo ser&aacute; tu compa&ntilde;ero fiel cada tarde a la hora del t&eacute;.</li>\r\n	<li>Fabricado con silic&oacute;n 100% grado alimenticio, sin BPA, que es un material no toxico, durable y totalmente inocuo, este infusor es una forma aventurera de preparar tu bebida.</li>\r\n	<li>Ya sea que escojas hierbabuena, menta, canela o tu sabor favorito, este compa&ntilde;ero har&aacute; de todas tus hojas una bebida deliciosa.</li>\r\n	<li>Su dise&ntilde;o permite el paso del agua mas f&aacute;cilmente.&nbsp;</li>\r\n	<li>Solo rell&eacute;nalo con las hojas de t&eacute;&nbsp;que mas te gusten, gira la parte inferior, col&oacute;calo en la taza y vierte agua caliente.&nbsp;</li>\r\n	<li>Su tanque de contrapeso hace que sea m&aacute;s f&aacute;cil mantenerlo en posici&oacute;n y al estar hecho de acero inoxidable no debes de preocuparte de que pierda su calidad al momento de lavarlo.&nbsp;</li>\r\n	<li>El silic&oacute;n jam&aacute;s dejar&aacute; un sabor extra&ntilde;o en tu t&eacute;.</li>\r\n	<li>Ligero, durable, f&aacute;cil de usar.</li>\r\n	<li>Muy f&aacute;cil de limpiar, solo necesitas agua fr&iacute;a y jab&oacute;n. Es seguro para lavavajillas.&nbsp;</li>\r\n	<li>El regalo ideal para aquellos que aman el t&eacute; y los deportes acu&aacute;ticos.&nbsp;</li>\r\n	<li>Muy practico para usarse en casa o para llevarlo de viaje contigo.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '112.00', '140.00', 'MXN', 'no', 'no', 25, 1, 1, 'No disponible para la venta', '2019-07-23 17:59:37', '2019-07-23 17:59:37', '2019-07-23 17:59:37', '6.00', '10.00', '4.00', '0.16', '0.06', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(36, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Set de 12 marcadores en forma de animales para copas o vasos.', 'set-de-marcadores-para-copas-o-vasos', '<p>Divertidos y pr&aacute;cticos marcadores para copas y vasos en forma de animales.</p>\r\n', '<ul>\r\n	<li>Distingue las bebidas de cada invitado con estos 12 marcadores en colores y figuras variadas.</li>\r\n	<li>Encanta a tus invitados y has que&nbsp;sus bebidas sean f&aacute;cilmente reconocibles para que no puedan confundirlas.</li>\r\n	<li>Muy simples de usar y quitar.</li>\r\n	<li>Su chup&oacute;n de succi&oacute;n es durable y se adhiere muy bien a superficies planas no porosas como vasos, copas e incluso al acero inoxidable.</li>\r\n	<li>Puedes usarla una y otra vez.</li>\r\n	<li>No dejan residuos en tus vasos o copas.</li>\r\n	<li>Excelente regalo para cualquier amante del vino y de las reuniones con amigos.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '110.00', '250.00', 'MXN', 'no', 'no', 25, 1, 1, 'No disponible para la venta', '2019-08-08 22:56:52', '2019-08-08 22:56:52', '2019-08-08 22:56:52', '10.00', '10.00', '10.00', '0.06', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(37, '5c9c1ff62ce0c3.78174962', 1, '', '', '', '¡Que comience la fiesta! Y que tus invitados no confundan sus bebidas con este set de 6 marcadores para copas o vasos en forma de pequeños y coloridos hombres.', 'set-de-6-marcadores-en-forma-de-pequeños-hombres-para-copas-y-vasos', '<ul>\r\n	<li>Que tus invitados no confundan sus bebidas y as&iacute; no se desperdicia ese vino o licor por no saber quien era el due&ntilde;o del vaso o la copa, con este set de 6 marcadores para copas o vasos en forma de peque&ntilde;os y coloridos hombres.</li>\r\n	<li>Como sabemos que lo tuyo son las fiestas e invitar a tus amigos a pasar un rato divertido en tu casa, te tenemos este fabuloso set para marcar copas y vasos.&nbsp;</li>\r\n	<li>Estos coloridos amigos se har&aacute;n cargo de que todos tus amigos sepan en donde est&aacute; su bebida en cualquier momento durante la reuni&oacute;n.&nbsp;</li>\r\n	<li>Solo tienes que colocarlos en la base de la copa o en el filo del vaso y a disfrutar de las bebidas</li>\r\n	<li>El set incluye 6 hombrecitos en colores variados.&nbsp;</li>\r\n	<li>Est&aacute;n fabricados con silic&oacute;n flexible y duradero.&nbsp;</li>\r\n	<li>F&aacute;ciles de lavar, solo agrega jab&oacute;n y enjuaga.&nbsp;</li>\r\n	<li>Son tan &uacute;tiles y pr&aacute;cticos que ser&aacute;n siempre los primeros en la fiesta. &nbsp;</li>\r\n</ul>\r\n\r\n<p><em>Y como queremos que la fiesta sea en grande</em></p>\r\n\r\n<p><em>ll&eacute;vate 2 sets por 176.70 &oacute; 3 sets por 256.68</em></p>\r\n', '<ul>\r\n	<li>Divertidos marcadores ideales para usar en tus fiestas.&nbsp;</li>\r\n	<li>Tus invitados podr&aacute;n marcar de forma clara sus bebidas y no perderlas de vista durante la noche, ni tomarse la de alguien mas.&nbsp;</li>\r\n	<li>6 colores diferentes. Fabricados en silic&oacute;n.</li>\r\n	<li>Flexibles y muy durables.</li>\r\n	<li>Ligeros, pr&aacute;cticos y muy f&aacute;ciles&nbsp;de lavar.&nbsp;</li>\r\n	<li>No te quedes sin este accesorio que permitir&aacute; a tus invitados disfrutar m&aacute;s de la fiesta.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '93.00', '122.00', 'MXN', 'no', 'no', 20, 1, 1, 'No disponible para la venta', '2019-08-08 00:15:25', '2019-08-08 00:15:25', '2019-08-08 00:15:25', '1.50', '3.50', '1.00', '0.10', '0.06', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(39, '5c9c1ff62ce0c3.78174962', 1, 'Reposa bolsas de té en forma de caracol.  ', 'Prácticos y útiles reposa bolsas para té en forma de caracol. Tu bolsa de té jamás volverá a irse al fondo de la taza. Fabricados en silicón grado alimenticio. ', 'reposa bolsas de té, reposa bolsas de té de silicón, ', 'Set de 6 reposa bolsas de té en forma de caracol.', 'infusores-para-té-en-forma-de-caracol', '<ul>\r\n	<li>&iquest;Te molesta que el hilo de tu bolsa de t&eacute; se vaya al fondo cada vez que agregas el agua a la taza?&nbsp;&iquest;Te has quemado los dedos intentando sacar la bolsa de t&eacute; de la&nbsp;taza?</li>\r\n	<li><strong>! Te tenemos la soluci&oacute;n !</strong></li>\r\n	<li>Con estos adorables reposa bolsas en forma de caracoles podr&aacute;s sostener tu bolsa&nbsp;de t&eacute; en la taza para que&nbsp;solo disfrutes&nbsp;de tu t&eacute; sin volver a enojarte; solo enrolla el cordel de tu bolsa&nbsp;de t&eacute; en el cuerpo del caracol y tu bolsa no volver&aacute; a hundirse cuando viertas el agua.&nbsp;</li>\r\n	<li>6 piezas de colores surtidos.&nbsp;</li>\r\n	<li>Hecho de gel de s&iacute;lice 100 % puro (calidad alimentaria).&nbsp;</li>\r\n	<li>F&aacute;cil de usar y limpiar.&nbsp;Se puede lavar en el lavaplatos.</li>\r\n</ul>\r\n\r\n<p>Por tiempo limitado, ll&eacute;vate 2 juegos por tan solo $153.90 &oacute; 3 juegos por $223.56</p>\r\n', '<ul>\r\n	<li>Hechos de silic&oacute;n grado alimenticio no toxico.&nbsp;</li>\r\n	<li>Estos adorables caracoles son totalmente seguros para usarlos en tus bebidas.&nbsp;Olv&iacute;date de introducir los dedos en el agua para sacar la bolsa de t&eacute; cuando esta se va hacia adentro de la taza o cuando tu bebida est&aacute; en el punto exacto.&nbsp;&nbsp;</li>\r\n	<li>Ligeros, durables y f&aacute;ciles de usar.&nbsp;</li>\r\n	<li>El regalo ideal para los amantes del t&eacute;.</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '81.00', '109.00', 'MXN', 'no', 'no', 20, 1, 1, 'No disponible para la venta', '2019-08-19 17:17:00', '2019-08-19 17:17:00', '2019-08-19 17:17:00', '0.50', '0.50', '0.50', '0.13', '0.03', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(40, '5c9c1ff62ce0c3.78174962', 1, 'Hermosa sombrilla china fabricada en papel y bambú. Ideal para proteger tu piel.  ', 'Hermosa sombrilla china fabricada en papel y bambú. Ideal para proteger tu piel de la radiación o para decorar una fiesta o habitación con un toque elegante.   ', 'sombrillas de bambú, sombrillas de papel, sombrilla china, sombrilla elegante de papel, sombrilla de papel para protegerse del sol, sombrilla para decorar, sombrilla para decoración, ', 'Coloridas sombrilla de papel ideales para protegerte de la radiación solar. ', 'fabulosa-sombrilla-de-papel-ideal-para-protegerte-del-sol', '<ul>\r\n	<li>La radiaci&oacute;n solar se ha vuelto uno de los enemigos principales de tu piel. Protegerte de ellos es vital hoy en d&iacute;a, y hacerlo de una forma elegante y diferente nos viene bien a todas.&nbsp;</li>\r\n	<li>Estas sombrilla de papel te protegen de la radiaci&oacute;n y, junto con tus tratamientos cotidianos, te permitir&aacute;n mantener tu cara linda y saludable.</li>\r\n	<li>Con sus 83 cm de di&aacute;metros te cubren perfectamente protegiendo incluso tus brazos de los rayos del sol.&nbsp;</li>\r\n	<li>Est&aacute;n hechas a mano y decoradas con patrones orientales.</li>\r\n	<li>Contamos con 10 hermosos dise&ntilde;os.</li>\r\n	<li>Adem&aacute;s de protegerte de la radiaci&oacute;n solar, puedes utilizarlas para decorar una fiesta o para ponerle un toque diferente a cualquier habitaci&oacute;n.</li>\r\n	<li>Est&aacute;n fabricadas con papel encerado y su mango de bamb&uacute;.</li>\r\n	<li>Son muy durables y resistentes.&nbsp;</li>\r\n</ul>\r\n\r\n<p><em>Solo durante el mes de julio ll&eacute;vate 2 sombrillas por $285.00&nbsp; o&nbsp;&nbsp;3 sombrillas por $414.00.&nbsp; &nbsp;Aprovecha y protege tu piel todos los d&iacute;as.&nbsp;</em></p>\r\n', '<ul>\r\n	<li>﻿Excepcional parasol de papel con&nbsp;10 hermosos dise&ntilde;os.</li>\r\n	<li>Totalmente realizado a mano. Con patrones&nbsp;orientales cl&aacute;sicos .</li>\r\n	<li>Ideal para protegerse de la radiaci&oacute;n solar y mantener tu piel linda y saludable todos lo d&iacute;as.&nbsp;</li>\r\n	<li>Una opci&oacute;n perfecta para decorar una fiesta, recamara o estancia.&nbsp;</li>\r\n	<li>Hechas con papel encerado de alta calidad.&nbsp;</li>\r\n	<li>Con mango de bamboo durable y resistente.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '150.00', '180.00', 'MXN', 'no', 'no', 71, 1, 1, 'No disponible para la venta', '2019-08-19 22:04:18', '2019-08-19 22:04:18', '2019-08-19 22:04:18', '83.00', '42.00', '0.00', '0.52', '0.40', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1);
