(41, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Útiles cucharas medidoras de acero inoxidable. Importado de USA. ', 'Útiles-cucharas-medidoras-de-acero-inoxidable', '<ul>\r\n	<li>&Uacute;til y pr&aacute;ctico set de 4 cucharas para medici&oacute;n de alimentos.&nbsp;</li>\r\n	<li>No vuelvas a adivinar si estas usando la cantidad correcta de tus ingredientes al preparar tus recetas favoritas. Con estas cucharas&nbsp;medidoras tendr&aacute;s el control&nbsp;total para preparar exquisitos platillos que a tu familia les encantar&aacute;n.</li>\r\n	<li>Este set viene con un anillo para mantener las cucharas juntas.</li>\r\n	<li>La capacidad es de 1 cucharada sopera, 1 cucharadita de t&eacute;, 1/2 cucharadita de t&eacute; y 1/4 cucharadita de t&eacute;.</li>\r\n	<li>Producto importado de Estados Unidos.&nbsp;</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Capacidad claramente grabada en la cuchara.&nbsp;&nbsp;</li>\r\n	<li>Con acabado espejo por dentro y por fuera.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '179.00', '0.00', 'MXN', 'no', 'no', 1, 1, 1, 'No disponible para la venta', '2019-08-02 18:53:55', '2019-08-02 18:53:55', '2019-08-02 18:53:55', '2.00', '12.00', '2.00', '0.13', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
