(50, '5c9c1ff62ce0c3.78174962', 1, 'Divertidos y ecológicos platos para bebe fabricados con bambú reciclable. ', 'Divertidos y ecológicos platos para bebe fabricados con bambú reciclable. Una linda forma de alimentar a tu bebe y de cuidar el ambiente.', 'platos ecológicos, platos ecológicos de bambú, platos de fibra de bambú, platos ecológicos de bamboo, platos ecológicos para bebe, ', 'Para tu bebé tenemos estos hermosos, divertidos y ecológicos platos fabricados con bambú.', 'platos-para-bebe-totalmente-reciclables', '<ul>\r\n	<li>Divertidos platos para bebe fabricados con bamb&uacute; 100% reciclable.</li>\r\n	<li>Viene en 8 hermosos dise&ntilde;os</li>\r\n	<li>Que la hora de la comida de tus beb&eacute;s sea una experiencia divertidamente nutritiva.</li>\r\n	<li>Motiva y estimula a tu bebe&nbsp;con los coloridos dise&ntilde;os y figuras.&nbsp;</li>\r\n	<li>Resistentes y duraderos</li>\r\n	<li>Se pueden limpiar en el lavavajillas</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Has volar la imaginaci&oacute;n de tus peque&ntilde;os angelitos mientras&nbsp;los alimentas de forma nutritiva. &nbsp;</li>\r\n	<li>Seguros para lavarse en lavavajillas.&nbsp;</li>\r\n	<li>Resistentes y duraderos.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '135.00', '0.00', 'MXN', 'no', 'no', 8, 1, 1, 'No disponible para la venta', '2019-08-19 19:24:19', '2019-08-19 19:24:19', '2019-08-19 19:24:19', '16.00', '10.00', '0.00', '0.25', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(51, '5c9c1ff62ce0c3.78174962', 1, 'Café artesanal de altura del estado de Puebla. Producción familiar. ', 'Café artesanal de altura del estado de Puebla. Café de producción familiar, siguiendo técnicas amigables con el ambiente. Libre de agroquímicos. ', 'café artesanal, café de producción familiar, café de altura Puebla, café artesanal Puebla, ', 'Delicioso Café artesanal Cuetzalin . ¡Un producto con propósito!.', 'café-quetzalin', '<ul>\r\n	<li>Caf&eacute; artesanal producido en la regi&oacute;n de Cuetzalan, Puebla.</li>\r\n	<li>Cultivado con el cari&ntilde;o y cuidado de diferentes generaciones, de una misma familia, este caf&eacute; crece a la sombra de los arboles a 1560 metros sobre el nivel del mar.&nbsp;</li>\r\n	<li>Libre de agroqu&iacute;micos, pesticidas y fertilizantes.</li>\r\n	<li>Variedad Ar&aacute;bica.</li>\r\n	<li>Ideal para preparar tu caf&eacute; negro cada ma&ntilde;ana, ya sea que disfrutes de tu caf&eacute; fr&iacute;o o caliente.&nbsp;</li>\r\n	<li>Tostado&nbsp;y molido medio, excelente para cafeteras italianas, de filtro y de espresso.&nbsp;&nbsp;</li>\r\n	<li>Disponible en presentaci&oacute;n de 1/2 y 1/4 de kilo.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Libre de agroqu&iacute;micos, pesticidas y fertilizantes, este caf&eacute; artesanal es el mejor acompa&ntilde;ante cada ma&ntilde;ana si lo que buscas en disfrutar de un caf&eacute; libre de sustancias toxicas o nocivas para ti o para el ambiente.&nbsp;</li>\r\n	<li>El caf&eacute; Cuetzalin&nbsp;ha sido producido durante generaciones en esta regi&oacute;n siguiendo t&eacute;cnicas ancestrales respetuosas con el medio ambiente.&nbsp;&nbsp;</li>\r\n	<li>Bajo el cari&ntilde;o y cuidado de diferentes generaciones, este excelente caf&eacute; crece a la sombra de los arboles a 1560 metros sobre el nivel del mar.&nbsp;</li>\r\n	<li>Variedad Ar&aacute;bica.&nbsp;</li>\r\n	<li>Tostado medio.</li>\r\n	<li>No te quedes sin probar este magnifico tesoro culinario de M&eacute;xico y de ayudar a que todos aquellos que siembran, cuidan, cosechan y procesan el caf&eacute;, generen los medios necesarios para elevar su calidad de vida y la de su comunidad.&nbsp;</li>\r\n	<li>Apoya y ayuda a mantener la producci&oacute;n de caf&eacute; 100% mexicano en Puebla.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>POR LANZAMIENTO, LL&Eacute;VATE UN KILOGRAMO POR $190.00</li>\r\n</ul>\r\n', '', 'México', 'si', '', '', '', '', '', '', '190.00', '0.00', 'MXN', 'no', 'no', 353, 1, 1, 'No disponible para la venta', '2019-09-02 04:03:29', '2019-09-02 04:03:29', '2019-09-02 04:03:29', '15.00', '22.00', '8.00', '0.62', '0.50', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(52, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Bolsas de malla para lavar ropa delicada ', 'bolsas-de-malla-para-lavar-ropa-delicada', '<ul>\r\n	<li>Set de 5 bolsas para lavar ropa delicada y lencer&iacute;a.</li>\r\n	<li>Simplemente coloca de 2 a 3 piezas de ropa en las bolsas, ci&eacute;rralas e introduce la malla&nbsp; a la lavadora con el resto de tu ropa.</li>\r\n	<li>Lava normalmente.</li>\r\n	<li>Al finalizar el ciclo de lavado podr&aacute;s sacar f&aacute;cilmente la bolsa y darle a tus prendas consentidas el mejor cuidado.</li>\r\n	<li>El set incluye 1 bolsa de tama&ntilde;o peque&ntilde;o (23 x 30 cm), 1 de tama&ntilde;o mediano (30 x 40 cm), 1 de tama&ntilde;o grande (40 x 50 cm) y 2 bolsas para ropa interior.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>&iquest;Te gustar&iacute;a que tu ropa favorita se mantuviera como nueva por m&aacute;s tiempo?</li>\r\n	<li>&iquest;Y que tu&nbsp;ropa interior no pierda&nbsp;su forma en cada lavada cuando tienes que lavarlos en la lavadora?</li>\r\n	<li>No te preocupes m&aacute;s, con este set de mallas para lavar tu ropa no volver&aacute;s a sacar tus prendas favoritas de en medio de un nudo de ropa.</li>\r\n	<li>Simplemente coloca de 2 a 3 piezas de ropa en las bolsas, ci&eacute;rralas e introduce la malla&nbsp; a la lavadora con el resto de tu ropa.</li>\r\n	<li>Lava normalmente.</li>\r\n	<li>Al finalizar el ciclo de lavado podr&aacute;s sacar f&aacute;cilmente la bolsa y darle a tus prendas consentidas el mejor cuidado.</li>\r\n	<li>La bolsa no desprende ning&uacute;n tipo de pelusa.&nbsp;</li>\r\n	<li>El set incluye 1 bolsa de tama&ntilde;o peque&ntilde;o (23 x 30 cm), 1 de tama&ntilde;o mediano (30 x 40 cm), 1 de tama&ntilde;o grande (40 x 50 cm) y 2 bolsas para ropa interior.</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '195.00', '229.00', 'MXN', 'no', 'no', 30, 1, 1, 'No disponible para la venta', '2019-08-08 00:16:55', '2019-08-08 00:16:55', '2019-08-08 00:16:55', '2.00', '2.00', '2.00', '0.38', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(53, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Set de 6 bolsas de vacío para almacenar comida en el refrigerador con bomba. ', 'bolsas-de-vacío-para-almacenar-comida-en-el-refrigerador', '<ul>\r\n	<li>Olv&iacute;date de la carne con quemaduras por el frio del congelador.</li>\r\n	<li>Ten siempre a la mano frutas y verduras congeladas para prepararte tus licuados cada ma&ntilde;ana.</li>\r\n	<li>Con estas bolsas de vac&iacute;o para guardar comida en el refrigerador tus congelados durar&aacute;n por m&aacute;s tiempo y se mantendr&aacute;n en condiciones &oacute;ptimas.&nbsp;</li>\r\n	<li>El set incluye 2 bolsas de 21 x 28 cm,&nbsp;2 bolsas de 16 x 28 cm y&nbsp;2 bolsas de 36 x 34 cm y bomba de vac&iacute;o.&nbsp;</li>\r\n	<li>Puedes almacenar carnes, frutas o verduras.</li>\r\n	<li>Totalmente reutilizables y seguras.&nbsp;</li>\r\n	<li>Mant&eacute;n tus alimentos frescos por hasta 5 veces mas tiempo que con las formas tradicionales de almacenaje.</li>\r\n	<li>Solo introduce tus alimentos, cierra la bolsa y col&oacute;cala sobre una mesa o una superficie plana, sin levantar la bolsa, coloca la bomba sobre el c&iacute;rculo azul que esta en la bolsa y extrae todo el aire con la bomba y listo. Puedes almacenar en tu congelador o en el refrigerador.</li>\r\n	<li>F&aacute;ciles de lavar.&nbsp;No adsorben olores, ni sabores.</li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Ll&eacute;vate 2 sets por tan solo $406.60 &oacute; 3 sets por $590.64.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<ul>\r\n	<li>Con estas fant&aacute;sticas bolsas podr&aacute;s sentirte seguro de almacenar y congelar tus alimentos.&nbsp;</li>\r\n	<li>Puedes almacenar carnes, frutas o verduras.&nbsp;</li>\r\n	<li>Totalmente reutilizables y seguras.&nbsp;</li>\r\n	<li>Mant&eacute;n tus alimentos frescos por hasta 5 veces mas tiempo que con las formas tradicionales de almacenaje.</li>\r\n	<li>Congela tus carnes en las mejores condiciones hasta el momento de cocinarlas o conserva tus frutas favoritas para hacer esas deliciosas malteadas matutinas</li>\r\n	<li>Solo introduce tus alimentos, cierra la bolsa,&nbsp;extrae todo el aire con la bomba y listo. Puedes almacenar en tu congelador o en el refrigerador.</li>\r\n	<li>Evitan que los alimentos se quemen en el congelador.</li>\r\n	<li>Son f&aacute;ciles de lavar y tienes que preocuparte por estar desechando&nbsp;papel film o aluminio.</li>\r\n	<li>No adsorben olores, ni sabores.</li>\r\n	<li>El material es totalmente seguro para alimentos, no desprende ning&uacute;n tipo de sabor ni olor.</li>\r\n	<li>El set incluye 2 bolsas de 21 x 28 cm,&nbsp;2 bolsas de 16 x 28 cm y&nbsp;2 bolsas de 36 x 34 cm.</li>\r\n	<li>Incluyen bomba de vac&iacute;o.</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '214.00', '300.00', 'MXN', 'no', 'no', 15, 1, 1, 'No disponible para la venta', '2019-08-06 00:18:03', '2019-08-06 00:18:03', '2019-08-06 00:18:03', '28.00', '16.00', '1.00', '0.40', '0.21', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(54, '5c9c1ff62ce0c3.78174962', 1, '', '', '', '6 Bolsas de vacío para almacenar ropa con bomba incluida.', 'bolsas-de-vacío-para-almacenar-ropa', '<ul>\r\n	<li>Set de 6 bolsas para almacenaje de ropa, sabanas, toallas o cobijas.</li>\r\n	<li>No vuelvas a sufrir por no tener espacio suficiente para guardar cobijas, sabanas o la ropa extra que no quieres en tu closet.</li>\r\n	<li>Estas pr&aacute;cticas bolsas te ahorran m&aacute;s de la mitad del espacio y mantienen tu ropa libre de polvo.</li>\r\n	<li>Solo introduce&nbsp;la ropa limpia y totalmente seca,&nbsp;cierra la bolsa y extrae&nbsp;el aire con la bomba manual o con tu aspiradora.</li>\r\n	<li>En pocos segundos notaras como la bolsa comienza a desinflarse y tu ropa ocupa menos de la mitad del espacio que antes.</li>\r\n	<li>El set incluye 2 bolsas de 40 x 50 cm, 2 bolsas de 50 x 70 cm y 2 bolsas de 60 x 80 cm y bomba de vac&iacute;o.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>No vuelvas a sufrir por no tener espacio suficiente para guardar cobijas, sabanas o la ropa extra que no quieres en tu closet.</li>\r\n	<li>Estas pr&aacute;cticas bolsas te ahorran m&aacute;s de la mitad del espacio y mantienen tu ropa libre de polvo.</li>\r\n	<li>Solo tienes que introducir la ropa limpia y totalmente seca, acomodarla cuidadosamente, cerrar la bolsa y extraer el aire con la bomba manual o con tu aspiradora.</li>\r\n	<li>En pocos segundos notaras como la bolsa comienza a desinflarse y tu ropa ocupa menos de la mitad del espacio que antes.</li>\r\n	<li>Su cierre doble y su v&aacute;lvula triple permiten que todo el aire salga e impiden que vuelva a entrar.&nbsp;</li>\r\n	<li>No te preocupes por malos olores, bacterias o moho ya que el material con las que est&aacute;n hechas no permite la formaci&oacute;n de ninguno.&nbsp;</li>\r\n	<li>Las bolsas no desprenden ning&uacute;n aroma y mantienen a tu ropa protegida del polvo, por lo que al sacarla esta estar&aacute; como reci&eacute;n lavada.</li>\r\n	<li>El set incluye 2 bolsas de 40 x 50 cm, 2 bolsas de 50 x 70 cm y 2 bolsas de 60 x 80 cm</li>\r\n	<li>Incluye bomba de vac&iacute;o.</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '220.00', '320.00', 'MXN', 'no', 'no', 15, 1, 1, 'No disponible para la venta', '2019-08-01 00:59:16', '2019-08-01 00:59:16', '2019-08-01 00:59:16', '40.00', '50.00', '2.00', '0.62', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
