(57, '5d0ab3549fe593.01622310', 9, '', '', '', 'Cartucho estandar 53 para filtracion de agua', 'cartucho-estandar-53-para-filtracion-de-agua', '<p>Cartucho para purificaci&oacute;n del agua, construido con carbon de coco de la mas alta calidad, est&aacute;ndar 53NSF.</p>\r\n', '<p>Carrucho de carbon activado de 0.5 micrones. Elimina plomo, quistes, mercurio, etilenos, cloro, malos olores y sabores. Tiempo de vida de aproximadamente 1 a&ntilde;o garantizado. Rinde 1000 galones de agua perfectamente purificada.</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '100.00', '0.00', 'USD', 'si', 'no', 1000, 1, 1, 'No disponible para la venta', '2019-08-01 01:11:14', '2019-08-15 17:22:38', '2019-08-01 01:11:14', '12.50', '16.00', '0.00', '450.00', '0.45', 'normal', 'nuevo', 0, '0.00', 'es', 'inactivo', 1),
