(59, '5c9c1ff62ce0c3.78174962', 1, 'Conejos reposa bolsa de té. Ideales para cualquier tipo de taza. ', 'Estos encantadores conejos reposa bolsas sostendrán la bolsa de té para que no se vaya al fondo de la taza. Sirven también como plato para colocar la bolsa cuando tu té está listo. ', 'reposa bolsas de té, reposa bolsa en forma de conejo, reposa bolsa para té, ', 'Set de 4 reposa bolsas de té en forma de conejo.', 'set-de-4-clips-para-bolsas-de-té-en-forma-de-conejo', '<ul>\r\n	<li>&iexcl; Incre&iacute;ble ! Un conejo que sujeta la bolsa de t&eacute; en su lugar y tambi&eacute;n sirve para poner la bolsa de t&eacute; cuando ya est&aacute; listo :)</li>\r\n	<li>Este accesorio 2 en 1 ser&aacute; la envidia de tus amigas.</li>\r\n	<li>El set es de 4 piezas pero los colores son al azar en cada set. Hay 5 colores disponibles.</li>\r\n	<li>Solo tienes que colocar el conejo en la orilla de tu taza, enrolla el hilo a trav&eacute;s de sus orejas y&nbsp;tu bolsa no se ir&aacute; al fondo de la taza.</li>\r\n	<li>Cuando tu t&eacute; este listo, desenrolla el hilo de las orejas, coloca el conejo boca arriba en la mesa y pon ah&iacute; la bolsa mojada.</li>\r\n	<li>No m&aacute;s manchas en tu mantel, no m&aacute;s buscar donde colocar la bolsa mojada.</li>\r\n	<li>Con un solo utensilio tendr&aacute;s ambos problemas resueltos y solo tendr&aacute;s que preocuparte de no perderte la conversaci&oacute;n.</li>\r\n	<li>Fabricado con silic&oacute;n grado alimenticio,&nbsp;es completamente seguro para utilizarse en alimentos y bebidas.&nbsp;</li>\r\n	<li>F&aacute;ciles de lavar. Son aptas para lavavajillas.&nbsp;</li>\r\n</ul>\r\n\r\n<p>Y ya que entre m&aacute;s es mejor, aprovecha y ll&eacute;vate 2 sets por tan solo 235.60</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<ul>\r\n	<li>Fabricados con silic&oacute;n grado alimenticio, estos lindos conejos son una opci&oacute;n segura para auxiliarte al preparar tus bebidas.&nbsp;</li>\r\n	<li>Solo coloca el conejo en la orilla de la taza y enreda en sus orejas la tira de la bolsa de t&eacute;.&nbsp;</li>\r\n	<li>Nunca m&aacute;s tendr&aacute;s que estar pescando la bolsa para sacarla.&nbsp;</li>\r\n	<li>Cuando tu t&eacute; est&aacute; en el punto exacto, retira la bolsa y col&oacute;cala en la mesa sobre el conejo.&nbsp;</li>\r\n	<li>Jam&aacute;s tendr&aacute;s que volver a buscar que hacer con la bolsa mojada.&nbsp;</li>\r\n	<li>Ideales para los amantes del t&eacute;.&nbsp;</li>\r\n	<li>F&aacute;ciles de lavar. Son aptas para lavavajillas.&nbsp;</li>\r\n	<li>Set de 4 conejos en colores variados por juego.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '124.00', '140.00', 'MXN', 'no', 'no', 6, 1, 1, 'No disponible para la venta', '2019-08-19 17:34:33', '2019-08-19 17:34:33', '2019-08-19 17:34:33', '4.00', '9.00', '1.00', '0.15', '0.05', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(60, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Te tenemos unas mallas circulares especialmente diseñadas para el cuidado de tu ropa interior y tu lencería.', 'mallas-circulares-para-lavar-ropa-intima-o-lingerie', '<ul>\r\n	<li>Pr&aacute;cticas mallas de poliester ideales para lavar tu lencer&iacute;a o ropa delicada de tama&ntilde;o peque&ntilde;o.&nbsp;</li>\r\n	<li>Sus 16 cent&iacute;metros de di&aacute;metro y 17 de alto te permiten&nbsp;colocar hasta 3 brasieres y evitar que se maltraten o pierdan su forma durante el lavado.</li>\r\n	<li>Sus anillos de soporte arriba y abajo proporcionan la rigidez necesaria para que tus delicados&nbsp;no se maltraten.</li>\r\n	<li>Fabricados con fibra de poliester de alta calidad. No deja residuos en tu ropa ni pelusa.</li>\r\n	<li>Pueden utilizarse tambi&eacute;n para lavar juguetes de peluche peque&ntilde;os, ropa de bebe, medias y calcetines.&nbsp;</li>\r\n	<li>Tambi&eacute;n sirven para organizar tu ropa interior dentro de tu maleta y evitar que se maltraten o queden a la vista f&aacute;cilmente.&nbsp;</li>\r\n</ul>\r\n\r\n<p>Por introducci&oacute;n ll&eacute;vate 2 mallas x $232.00</p>\r\n', '<ul>\r\n	<li>Accesorio indispensables para que tus ropa interior&nbsp;mantengan su forma por mas tiempo. Sus 16 cent&iacute;metros de di&aacute;metro y 17 de alto te permiten&nbsp;colocar hasta 3 bras y evitar que se maltraten o pierdan su forma durante el lavado.</li>\r\n	<li>Su cierre abre completamente haciendo mas f&aacute;cil el acomodo de tus prendas en el interior.&nbsp;</li>\r\n	<li>El tama&ntilde;o de la malla permite el f&aacute;cil&nbsp;paso del agua y el jab&oacute;n dando como resultado un lavado completo.&nbsp;</li>\r\n	<li>Medidas aproximadas: 16 x 17 cent&iacute;metros.&nbsp;</li>\r\n	<li>Colores variados.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '125.00', '150.00', 'MXN', 'no', 'no', 20, 1, 1, 'No disponible para la venta', '2019-08-08 00:18:50', '2019-08-08 00:18:50', '2019-08-08 00:18:50', '16.00', '17.00', '0.00', '0.06', '0.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(61, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Tetera en acero inoxidable 18/8 con cuello de cisne.  Importado de USA. Envío gratis. ', 'tetera-en-acero-inoxidable-188', '<ul>\r\n	<li>Hermosa y elegante tetera con cuello de cisne de acero inoxidable 18/8.</li>\r\n	<li>Capacidad de 1 lt.</li>\r\n	<li>Ideal para preparar tu t&eacute;&nbsp;o para agregar el agua a tus cafeteras francesas.</li>\r\n	<li>Su cuello de cisne brinda mayor precisi&oacute;n al momento de servir.</li>\r\n	<li>Mango ergon&oacute;mico y antideslizante, muy c&oacute;modo y seguro.</li>\r\n	<li>Puede utilizarse en estufas de inducci&oacute;n.</li>\r\n	<li>Con acabado espejo en el exterior.</li>\r\n	<li>El regalo perfecto para cualquier persona aficionada el t&eacute;.&nbsp;</li>\r\n	<li>No te quedes sin aprovechar este exclusivo precio.&nbsp;</li>\r\n	<li>Producto importado de Estados Unidos.&nbsp;</li>\r\n	<li><strong>Env&iacute;o gratis.&nbsp;</strong></li>\r\n</ul>\r\n', '<ul>\r\n	<li>\r\n	<p>Fabricada con acero inoxidable 18/8, que es una de las aleaciones comerciales m&aacute;s seguras para su uso con alimentos, adem&aacute;s de que es muy resistente a las altas temperaturas (hasta 400 &ordm;C). Muy resistente al oxido y a la vez liviano, ideal para su uso en utensilios de cocina.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Elegante tetera con cuello de cisne.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Su cuello brinda mayor precisi&oacute;n al momento de servir, lo que evita derrames y riesgos de quemaduras.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Perfecto balance que permite que el mayor peso se encuentre del lado del mango.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Mango ergon&oacute;mico y antideslizante, muy c&oacute;modo y seguro. El pomo de la tapa no se calienta.</p>\r\n	</li>\r\n	<li>\r\n	<p>Apto para usarse en cualquier tipo de estufa, incluyendo las de inducci&oacute;n.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Capacidad aproximada de 1&nbsp;litros.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Con acabado espejo en el exterior. Hermosa para lucir en una reuni&oacute;n con amigas.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Env&iacute;o gratis con Mexpost.&nbsp;</p>\r\n	</li>\r\n</ul>\r\n\r\n<h3>&nbsp;</h3>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '693.00', '999.00', 'MXN', 'no', '6', 2, 1, 1, 'No disponible para la venta', '2019-08-02 18:32:50', '2019-08-02 18:32:50', '2019-08-02 18:32:50', '14.00', '13.00', '0.00', '0.46', '0.39', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(62, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Botella de acero inoxidable de doble capa con diseño camuflaje. Importado de USA. ', 'botella-de-acero-inoxidable-camuflaje-mantiene-la-temperatura-de-tus-bebidas-hasta-por-10-hrs', '<ul>\r\n	<li>Botella que permite mantener la temperatura de tus bebidas hasta por 10 horas dado su alto est&aacute;ndar en rendimiento t&eacute;rmico y de su dise&ntilde;o de doble capa</li>\r\n	<li>Dise&ntilde;ada para ser totalmente anti fugas; totalmente segura para que la lleves en tu bolsa o mochila.</li>\r\n	<li>Tiene una capacidad de 500 mililitros</li>\r\n	<li>Est&aacute; elaborada con acero inoxidable grado alimenticio.</li>\r\n	<li>Totalmente libre de BPA.</li>\r\n	<li>Producto importado de Estados Unidos.&nbsp;</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Su doble pared con aislamiento al vac&iacute;o evita que la temperatura exterior afecte a los l&iacute;quidos que est&aacute;n en el interior.&nbsp;&nbsp;</li>\r\n	<li>Excelente para llevar tu bebida favorita contigo a todas partes ya que su dise&ntilde;o es totalmente anti fugas o goteos.&nbsp;</li>\r\n	<li>Capacidad de 500 mililitros.&nbsp;</li>\r\n	<li>Ideal para los amantes de los exteriores o para tu viaje al trabajo.&nbsp;</li>\r\n	<li>Con el tama&ntilde;o ideal para que quepa en tu mochila o bolsa de viaje.</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '295.00', '0.00', 'MXN', 'no', 'no', 3, 1, 1, 'No disponible para la venta', '2019-09-02 22:58:06', '2019-09-02 22:58:06', '2019-09-02 22:58:06', '12.00', '27.00', '0.00', '400.00', '300.00', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(63, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Afilador de cuchillos de doble función. Importado de USA. Envío gratis. ', 'afilador-de-cuchillos-de-doble-función', '<ul>\r\n	<li>No vuelvas a tirar tus cuchillos porque no encuentras una forma f&aacute;cil y r&aacute;pida de afilarlos.&nbsp;</li>\r\n	<li>Con este pr&aacute;ctico afilador mant&eacute;n tus cuchillos siempre listos para cualquier corte.&nbsp;</li>\r\n	<li>Con dos etapas, una etapa gruesa compuesta por dos hojas de tungsteno y una etapa fina compuesta de dos hojas de cer&aacute;mica.&nbsp;</li>\r\n	<li>La primera etapa (Gruesa, ubicada cerca del mango y de color met&aacute;lico) se usa cuando el cuchillo est&aacute; desafilado.</li>\r\n	<li>La segunda etapa (Fina, ubicada cerca de la punta del afilador y de color blanco) se usa tras la primera etapa o para un reafilado regular de la hoja.</li>\r\n	<li>Puede utilizarse en casi cualquier tipo de cuchillos.&nbsp;</li>\r\n	<li>Simplemente desliza el cuchillo desde el mango hasta la punta ejerciendo un aligera presi&oacute;n y sujetando firmemente el afilador por el mango con la otra mano. No olvides realizar el proceso sobre una superficie firme.&nbsp;</li>\r\n	<li>Repite el proceso hasta alcanzar el afilado deseado.&nbsp;</li>\r\n	<li>Es importante limpiar la hoja del cuchillo antes y despu&eacute;s de pasarlo por el afilador.&nbsp;</li>\r\n	<li>Producto importado de Estados Unidos.&nbsp;</li>\r\n	<li><strong>Env&iacute;o incluido.&nbsp;</strong></li>\r\n</ul>\r\n', '<ul>\r\n	<li>Afilador de cuchillos con tungsteno y cer&aacute;mica.</li>\r\n	<li>Una etapa de tungsteno y una etapa de cer&aacute;mica que te permitir&aacute; un afilado adecuado con un terminado suave.</li>\r\n	<li>Para cualquier tipo de cuchillos.</li>\r\n	<li>Mango ergon&oacute;mico.</li>\r\n	<li>Para zurdos y diestros.</li>\r\n	<li>Env&iacute;o incluido con Correos de M&eacute;xico.</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '270.00', '350.00', 'MXN', 'no', '3', 3, 1, 1, 'No disponible para la venta', '2019-08-02 18:36:41', '2019-08-02 18:36:41', '2019-08-02 18:36:41', '20.00', '7.50', '5.00', '0.35', '0.25', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(64, '5c9c1ff62ce0c3.78174962', 1, 'No más lágrimas con este cortador de verduras y cebolla. Cortes homogéneos y fáciles. ', 'No hay verdura que se le resista a este cortador de verduras. No más lágrimas al picar cebolla ni cortadas accidentales. Fácil de lavar y con una tapa extra para almacenar en el mismo molde. ', 'cortador de verduras, cortador de cebolla, ', 'Cortador manual de cebollas, ajos y verduras en acero inoxidable. Importado de USA. Envío gratis. ', 'cortador-manual-de-cebollas-ajos-y-verduras', '<ul>\r\n	<li><strong>No m&aacute;s l&aacute;grimas cuando tengas que cortar cebolla para tus platillos favoritos</strong>.</li>\r\n	<li>Pr&aacute;ctico cortador de cebollas, ajos y verduras.</li>\r\n	<li>Cuchillas de acero inoxidable perfectamente afiladas para realizar cortes precisos de manera r&aacute;pida.</li>\r\n	<li>Mango y cubierta superior de acero inoxidable.</li>\r\n	<li>Cuerpo de pl&aacute;stico altamente resistente.</li>\r\n	<li>Con una tapa&nbsp;extra para que puedas guardar en el refrigerador tus verduras picadas sin tener que utilizar otro recipiente.</li>\r\n	<li>F&aacute;cil de desarmar y lavar.</li>\r\n	<li>Env&iacute;o incluido.</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Con cuchillas muy afiladas, este cortador hace el trabajo por ti. Solo introduce la cebolla o las verduras y presiona el mango. Lograras cortes uniformes.</li>\r\n	<li>Si requieres cortes m&aacute;s finos, solo continua presionando hasta alcanzar el tama&ntilde;o deseado.</li>\r\n	<li>Un utensilio que te facilitar&aacute; tus tareas diarias.</li>\r\n	<li>Ofrece m&aacute;xima seguridad: las cuchillas de este cortador de verduras son muy afiladas, lo que hace que la preparaci&oacute;n de alimentos sea muy c&oacute;moda y r&aacute;pida.</li>\r\n	<li>Se desarma completamente, con lo que aseguras una correcta limpieza del equipo.&nbsp;</li>\r\n	<li>Se puede lavar a mano o en el lavaplatos. Preste atenci&oacute;n a las cuchillas cuando se lava a mano, para evitar lesiones en los dedos.</li>\r\n	<li>Tama&ntilde;o aproximado: 22 x 8,5 cm.</li>\r\n	<li>Env&iacute;o gratis con Correos de M&eacute;xico.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '280.00', '380.00', 'MXN', 'no', '3', 2, 1, 1, 'No disponible para la venta', '2019-08-21 21:19:17', '2019-08-21 21:19:17', '2019-08-21 21:19:17', '15.00', '21.00', '0.00', '0.45', '0.32', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(65, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Mantente calientito mientras ves la televisión con nuestras cobijas Fleece throw (tiro de lana). Importado de USA. Envío gratis. ', 'cobijas-fleece-thorw-tiro-de-lana', '<ul>\r\n	<li>Cobija ultra suave y confortable.</li>\r\n	<li>Tama&ntilde;o aproximado de 127 x 152&nbsp;cm.</li>\r\n	<li>100% Poliester</li>\r\n	<li>Ideales para acurrucarte en ella durante las tardes fr&iacute;as viendo la tele o para cubrir tus piernas mientras trabajas&nbsp;frente a la computadora.</li>\r\n	<li>Muy &uacute;tiles para llevarlas en el carro, durante un viaje o vuelo, o para un d&iacute;a en exteriores.</li>\r\n	<li>Producto importado de Estados Unidos.&nbsp;</li>\r\n	<li>Env&iacute;o incluido.&nbsp;</li>\r\n</ul>\r\n', '<ul>\r\n	<li>\r\n	<h3>Estas cobijas son muy suaves y resistentes.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Est&aacute;n elaboradas con 100% poliester muy f&aacute;cil de lavar. Solo ponlas&nbsp;en la lavadora y listo, quedar&aacute;n como nuevas despu&eacute;s de un ciclo normal de lavado. Pueden secarse en secadora pero debes de tener cuidado con que no reciban el calor directo utilizando la menor temperatura posible.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Ideales para tenerlas a la mano dentro de casa o para llevarlas contigo en el carro, en un avi&oacute;n o en un d&iacute;a de acampada.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Incluso puedes utilizarlas en las camas de tus mascotas, ellos tambi&eacute;n las amar&aacute;n.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Env&iacute;o gratis con Correos de M&eacute;xico.&nbsp;</h3>\r\n	</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '205.00', '245.00', 'MXN', 'no', '3', 3, 1, 1, 'No disponible para la venta', '2019-08-02 18:31:19', '2019-08-02 18:31:19', '2019-08-02 18:31:19', '152.40', '127.00', '0.00', '510.00', '0.41', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(66, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Termo para café que incluye una prensa francesa. Importado de USA. Envío gratis. ', 'termo-para-café-con-prensa-francesa', '<ul>\r\n	<li>Innovadora taza de viaje que es tambi&eacute;n una prensa francesa.</li>\r\n	<li>Prepara tu caf&eacute; o t&eacute; favorito en minutos, ci&eacute;rralo con su tapa para viaje y listo !!.</li>\r\n	<li>Una excelente herramienta para ahorrarte tiempo por las ma&ntilde;anas cuando tienes que correr al trabajo o a la escuela y solo te da tiempo de preparar tu taza de caf&eacute; o t&eacute;.</li>\r\n	<li>Ideal para preparar caf&eacute; o para una deliciosa infusi&oacute;n.</li>\r\n	<li>Fabricado con acero inoxidable de alta duraci&oacute;n con doble capa que evita que la temperatura exterior afecta a la temperatura de tu bebida.&nbsp;</li>\r\n	<li>Solo agrega caf&eacute; molido y agua, espera unos minutos, desliza la prensa y listo.&nbsp;</li>\r\n	<li>Si lo prefieres, agrega tu infusi&oacute;n o tizana favorita y no te preocupes por las hierbas, solo presiona y disfruta de tu t&eacute;.&nbsp;</li>\r\n	<li>Lleva tu caf&eacute; reci&eacute;n preparado a todos lados y dile adi&oacute;s a los caf&eacute;s instant&aacute;neos o ins&iacute;pidos.</li>\r\n	<li>Un look exclusivo gracias a su magnifico base de acero inoxidable y su cubierta negra.</li>\r\n	<li>El regalo que todo el mundo espera.&nbsp;</li>\r\n	<li>Producto importado de&nbsp;Estados Unidos.</li>\r\n	<li>621 &nbsp;mililitros de capacidad.</li>\r\n	<li><strong>Env&iacute;o incluido.</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '<ul>\r\n	<li>\r\n	<h3>Si disfrutas del sabor inigualable que el m&eacute;todo de prensado franc&eacute;s brinda al caf&eacute;, este termo es el producto perfecto para ti.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Disfruta de este termo que tambi&eacute;n es una prensa francesa y prep&aacute;rate un delicioso caf&eacute; todas la ma&ntilde;anas.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Solo agrega 7 gramos de caf&eacute; (una cucharadita aproximadamente) por cada 125 ml de agua hirviendo, d&eacute;jalo reposar durante 4 minutos, presiona la prensa y listo!, un delicioso caf&eacute; que ira contigo a todas partes.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Puedes tambi&eacute;n agregar tus hojas de t&eacute; o tu infusi&oacute;n favorita y disfrutar de un arom&aacute;tico t&eacute; durante tu trayecto al trabajo.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Fabricado en acero inoxidable, no tendr&aacute;s que preocuparte porque su calidad disminuya.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Su boca ancha lo hace muy f&aacute;cil de lavar ya que puedes llegar hasta el fondo de la taza.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Viene con una tapa de alta seguridad que evita que tu bebida se riegue cuando te encuentras en movimiento con un sello de silic&oacute;n.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Ideal&nbsp; para aquellos que no pueden vivir sin su caf&eacute; matinal pero que no soportan las bebidas instant&aacute;neas.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Gracias a su dualidad no tendr&aacute;s que cargar contigo una cafetera y un termo, con este producto tienes ambos al mismo tiempo.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>El regalo perfecto para los amantes del caf&eacute;.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Env&iacute;o incluido con Mexpost.&nbsp;</h3>\r\n	</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '488.00', '550.00', 'MXN', 'no', 'no', 2, 1, 1, 'No disponible para la venta', '2019-09-02 22:59:06', '2019-09-02 22:59:06', '2019-09-02 22:59:06', '9.00', '16.00', '0.00', '0.52', '0.36', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
