(70, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Elegante y exclusiva jarra de acero inoxidable para servir o espumar leche. Importado de USA. Envío gratis.', 'elegante-jarra-para-servir-leche-de-acero-inoxidable-todas-tus-amistades-te-envidiaran', '<ul>\r\n	<li>Elegante e inigualable&nbsp;jarra de acero inoxidable para servir leche durante tus reuniones con amigos o familiares.</li>\r\n	<li>Una herramienta imprescindible para espumar leche para preparar capuchinos o para decorar tus bebidas.</li>\r\n	<li>Este accesorio de calidad profesional est&aacute; dise&ntilde;ado para que pueda ser utilizado tambi&eacute;n en casa. Es uno de los productos de origen italiano mejor vendidos en el mercado americano.</li>\r\n	<li>Capacidad aproximada de 550 mililitros (20 oz.)</li>\r\n	<li>Con un conveniente borde que permite servir desde todos los &aacute;ngulos.</li>\r\n	<li>Hecho en Italia.</li>\r\n	<li>No pagues los m&aacute;s de $800.00 que esta hermosa pieza llega a costar en tiendas. Aprovecha hoy nuestro gran precio de introducci&oacute;n.&nbsp;</li>\r\n	<li>Producto importado de Estados Unidos.&nbsp;</li>\r\n	<li><strong>Env&iacute;o gratis.&nbsp;</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '<ul>\r\n	<li>Todo el mundo te envidiara cuando vean esta hermosa jarra para servir leche en tu bandeja de servicio.&nbsp;</li>\r\n	<li>Totalmente fabricada en acero inoxidable de la mayor calidad, esta jarra se quedar&aacute; contigo para embellecer tus servicios por muchos a&ntilde;os.&nbsp;</li>\r\n	<li>Durable, resistente, f&aacute;cil de lavar y totalmente anti corrosi&oacute;n.&nbsp;</li>\r\n	<li>Puede utilizarse para espumar la leche en tu maquina de capuchino o para espumar para decorar tus bebidas con hermosos dise&ntilde;os.&nbsp;</li>\r\n	<li>Sus m&aacute;s de 500 mililitros de capacidad la hacen del tama&ntilde;o exacto para ser manejable y tener la capacidad necesaria para servir una buena cantidad de tazas.&nbsp;</li>\r\n	<li>Su reborde te permite tener un mejor control al momento de servir.&nbsp;</li>\r\n	<li>Hecho en Italia.</li>\r\n	<li>Env&iacute;o gratis con Mexpost.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '589.00', '800.00', 'MXN', 'no', '6', 1, 1, 1, 'No disponible para la venta', '2019-08-02 18:33:41', '2019-08-02 18:33:41', '2019-08-02 18:33:41', '13.00', '11.00', '0.00', '0.49', '0.39', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(71, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Con este filtro de agua para el lavabo realmente limpiarás tus manos en cada lavada. Importado de USA. Envío gratis.', 'filtro-para-lavabo-de-manos-con-carbón-activado', '<ul>\r\n	<li>\r\n	<p>Si el agua que sale de tu&nbsp;lavabo tiene olores desagradables o no conf&iacute;as en la calidad del agua debido a la tuber&iacute;a de tu casa o edificio, no te preocupes m&aacute;s, este filtro para el lavabo es la soluci&oacute;n a todos esos problemas.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Gracias a su cartucho de carb&oacute;n activado&nbsp;este filtro limpia el agua del lavabo de impurezas, bacterias, oxido, corrosi&oacute;n, cloro, entre otros contaminantes.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Es muy f&aacute;cil de usar, unicamente tienes que enroscarlo en tu grifo, mover la llave de paso y listo, el agua ser&aacute; filtrada inmediatamente y saldr&aacute; limpia.&nbsp;Sin mayor complejidad ni instalaciones complicadas.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Despreoc&uacute;pate por un a&ntilde;o y disfruta de agua limpia y pura para lavarte las manos o cepillarte los dientes.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Producto importado de Estados Unidos.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Env&iacute;o gratis.&nbsp;</strong></p>\r\n	</li>\r\n</ul>\r\n', '<p>Entre sus m&uacute;ltiples ventajas se encuentran:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Su precio reducido.</p>\r\n	</li>\r\n	<li>\r\n	<p>Alta confiabilidad y funcionalidad.</p>\r\n	</li>\r\n	<li>\r\n	<p>Duraci&oacute;n de 1 a&ntilde;o.</p>\r\n	</li>\r\n	<li>\r\n	<p>F&aacute;cil instalaci&oacute;n y f&aacute;cil manejo.</p>\r\n	</li>\r\n	<li>\r\n	<p>Puedes cambiar de agua filtrada a agua no filtrada con solo un movimiento de la llave de paso y as&iacute; prolongar la vida de tu cartucho.</p>\r\n	</li>\r\n	<li>\r\n	<p>Tendr&aacute;s agua realmente limpia cada que abras la llave.</p>\r\n	</li>\r\n	<li>\r\n	<p>Env&iacute;o gratis con Correos de M&eacute;xico.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '270.00', '385.00', 'MXN', 'no', '3', 3, 1, 1, 'No disponible para la venta', '2019-08-02 18:36:07', '2019-08-02 18:36:07', '2019-08-02 18:36:07', '12.00', '10.00', '7.00', '0.37', '0.27', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(72, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Sacacorchos y destapador en acero inoxidable. Importado de USA. Envío gratis.', 'sacacorchos', '<ul>\r\n	<li>Sacacorcho con alas de acero inoxidable.&nbsp;</li>\r\n	<li>La herramienta indispensable para cualquier persona que disfrute de una buena copa de vino.&nbsp;&nbsp;</li>\r\n	<li>Cuerpo muy resistente. Reforzado.&nbsp;</li>\r\n	<li>Con paneles t&aacute;ctiles suaves para mayor comodidad y m&aacute;ximos agarre.</li>\r\n	<li>Brazos de construcci&oacute;n fuerte que facilitan la extracci&oacute;n del corcho.&nbsp;</li>\r\n	<li>La parte superior es un pr&aacute;ctico destapador de botellas.&nbsp;</li>\r\n	<li>Producto importado de Estados Unidos.</li>\r\n	<li><strong>Env&iacute;o incluido con Correos de M&eacute;xico.&nbsp;</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<ul>\r\n	<li>Muy durable y resistente.</li>\r\n	<li>Su elegante dise&ntilde;o viene bien en cualquier cocina.</li>\r\n	<li>Puede utilizarse en el hogar, bares, en d&iacute;as de campo o para el picnic.</li>\r\n	<li>Excelente regalo para los amantes del vino.</li>\r\n	<li>Env&iacute;o incluido con Correos de M&eacute;xico.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '199.50', '250.00', 'MXN', 'no', '3', 2, 1, 1, 'No disponible para la venta', '2019-08-02 18:46:18', '2019-08-02 18:46:18', '2019-08-02 18:46:18', '7.00', '20.00', '5.00', '0.33', '0.23', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(73, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Útil y práctica ensaladera doble de acero inoxidable. ', 'util-y-práctica-ensaladera-doble-de-acero-inoxidable', '<ul>\r\n	<li>Ponte fit con estilo, comparte con tus amigos y familiares tu sana manera de comer.&nbsp;</li>\r\n	<li>Que tus ensaladas resalten en tu mesa con este juego de brillantes ensaladeras.&nbsp;</li>\r\n	<li>Ideal para tus mezclas de lechugas y vegetales frescos.</li>\r\n	<li>Puedes incluso servir una sopa fr&iacute;a.&nbsp;</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Atractivo acabado martillado.</li>\r\n	<li>Mantiene frescas las verduras por m&aacute;s tiempo gracias a su sistema de doble capa&nbsp;que que aisla los alimentos de la temperatura exterior.</li>\r\n	<li>Si quieres mejorar su eficacia coloca las ensaladeras sobre un recipiente con hielo y disfruta de tus vegetales como si fueran reci&eacute;n cosechados.</li>\r\n	<li>La ensaladera grande tiene 12.5 cm&nbsp;de alto y 22 cm&nbsp;de di&aacute;metro.</li>\r\n	<li>La peque&ntilde;a es de 9.5 cm de alto x 18 cm de di&aacute;metro.</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '1.00', '1.00', 'MXN', 'no', 'no', 1, 1, 1, 'No disponible para la venta', '2019-08-05 23:12:09', '2019-08-05 23:12:09', '2019-08-05 23:12:09', '22.50', '13.00', '1.00', '1.20', '1.04', 'normal', 'nuevo', 0, '0.00', 'es', 'inactivo', 1),
(74, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Taza para café o te de acero inoxidable. Importado de USA.', 'taza-para-café-o-te-de-acero-inoxidable', '<ul>\r\n	<li>Si est&aacute;s cansado de ver como el n&uacute;mero de tazas disminuye todo el tiempo y no quieres seguir gastando en reponerlas de manera interminable, &eacute;sta es la mejor opci&oacute;n para ti.&nbsp;</li>\r\n	<li>Duradera y resistente taza fabricada en acero inoxidable. A prueba de ca&iacute;das y abolladuras.&nbsp;</li>\r\n	<li>Est&aacute; formada por una doble capa de acero que impide que la temperatura exterior afecte la temperatura de tu bebida.&nbsp;</li>\r\n	<li>Mantiene tu caf&eacute; a temperatura por m&aacute;s tiempo.&nbsp;</li>\r\n	<li>Capacidad de 443 ml aproximadamente.&nbsp;</li>\r\n	<li>Excelente calidad.&nbsp;</li>\r\n	<li>Producto importado de Estados Unidos.</li>\r\n	<li><strong>Env&iacute;o gratis.</strong></li>\r\n</ul>\r\n', '<ul>\r\n	<li>No dudes y pru&eacute;bala, comprobar&aacute;s que tu bebida se mantienen a temperatura por m&aacute;s tiempo.&nbsp;</li>\r\n	<li>No importar&aacute; cuantos &quot;accidentes&quot; sufra, la taza estar&aacute; ah&iacute; cada ma&ntilde;ana para ti.&nbsp;</li>\r\n	<li>Totalmente fabricada en acero inoxidable lo que lo convierte en un producto de larga duraci&oacute;n.&nbsp;</li>\r\n	<li>No te quedes sin ella.&nbsp;</li>\r\n	<li>Env&iacute;o gratis con Correos de M&eacute;xico.&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '189.00', '220.00', 'MXN', 'no', '3', 3, 1, 1, 'No disponible para la venta', '2019-08-02 18:54:22', '2019-08-02 18:54:22', '2019-08-02 18:54:22', '9.00', '9.80', '0.50', '0.24', '0.14', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(75, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Práctico y elegante molino para especias, café y granos tostados. Importado de USA. Envío gratis. ', 'molino-para-café-o-especias', '<ul>\r\n	<li>Para ese caf&eacute; matutino, nada mejor que un molino !</li>\r\n	<li>Disfruta al m&aacute;ximo el sabor de tu caf&eacute; reci&eacute;n molido.&nbsp;</li>\r\n	<li>Este elegante molino te da el tama&ntilde;o de grano exacto para preparar tu caf&eacute; expreso.&nbsp;</li>\r\n	<li>Fabricado en acero inoxidable no tendr&aacute;s que preocuparte porque se oxide, se manche o var&iacute;e su calidad. No dejar&aacute; sabores extra&ntilde;os en tus granos molidos.&nbsp;</li>\r\n	<li>Puede usarse tambi&eacute;n para moler especias (comino, pimienta, etc.).&nbsp;</li>\r\n	<li>Aprovecha nuestro espectacular precio y ll&eacute;vate un producto que solo puedes conseguir en tiendas exclusivas.&nbsp;</li>\r\n	<li>Producto importado de Estados Unidos.&nbsp;</li>\r\n	<li><strong>Env&iacute;o gratis.&nbsp;</strong></li>\r\n</ul>\r\n', '<ul>\r\n	<li>Mide 12 x 18 x 12 cent&iacute;metros.&nbsp;</li>\r\n	<li>Ideal para moler caf&eacute;, granos secos y especias.&nbsp;</li>\r\n	<li>Todo el cuerpo est&aacute; fabricado en acero inoxidable.&nbsp;</li>\r\n	<li>Solo tienes que agregar los granos en el molino, sujetarlo firmemente y girar la manivela lentamente.&nbsp;</li>\r\n	<li>El grano molido ser&aacute; recogido en el caj&oacute;n. Desl&iacute;zalo cuidadosamente y obt&eacute;n tus granos perfectamente molidos y listos para utilizarse.</li>\r\n	<li>Producto importado de Estados Unidos.&nbsp;</li>\r\n	<li>Env&iacute;o gratis con Mexpost.&nbsp;&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '599.00', '700.00', 'MXN', 'no', '6', 1, 1, 1, 'No disponible para la venta', '2019-08-02 18:30:18', '2019-08-02 18:30:18', '2019-08-02 18:30:18', '12.00', '18.00', '12.00', '0.80', '0.61', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1);
