(76, '5c9c1ff62ce0c3.78174962', 1, '', 'Manos mágicas oaxaqueñas preparan para ti este delicioso chocolate artesanal hecho en metate, para que disfrutes en casa de esta deliciosa bebida milenaria. ', 'chocolate artesanal, chocolate artesanal oaxaqueño, chocolate hecho en metate, chocolate molido en metate, ', 'Desde la tierra de la punta del huaje, Oaxaca, traemos un delicioso chocolate artesanal. ¡Un producto con propósito!. Envío gratis. ', 'delicioso-chocolate-artesanal-oaxaqueño-un-producto-con-sentido', '<ul>\r\n	<li>Desde la zona de Oaxaca de Ju&aacute;rez, Oaxaca, te traemos este delicioso chocolate hecho a mano por las manos m&aacute;gicas de una productora regional.</li>\r\n	<li>Al calor de la madera, los granos de cacao son molidos lentamente en el metate para posteriormente ser vaciado en moldes individuales. El largo proceso es realizado por mujeres del pueblo y las largas horas de trabajo se acompa&ntilde;an de charlas interminables de sucesos cotidianos o relevantes.&nbsp;</li>\r\n	<li>Estas mujeres se ganan la vida preparando este chocolate con el mismo cari&ntilde;o y cuidado con&nbsp;el que preparan aquel que usar&aacute;n para sus celebraciones.&nbsp;</li>\r\n	<li>Tienes que probar este delicioso producto y apoyar a estas mujeres en su af&aacute;n por tener un futuro en donde las nuevas generaciones femeninas puedan alcanzar todos sus sue&ntilde;os y anhelos.&nbsp;</li>\r\n	<li>La bolsa contiene 5 tabletas de chocolate. Cada una alcanza para preparar cerca de un litro de leche o agua. El peso aproximado del paquete es de 550 gramos.&nbsp;</li>\r\n	<li>No importa si te gusta el chocolate con agua o con leche, lo importante es que tengas la oportunidad de tomar un producto totalmente hecho a mano, artesanal.&nbsp;</li>\r\n	<li>$200.00 la bolsa con env&iacute;o incluido.&nbsp;</li>\r\n</ul>\r\n\r\n<p>NOTA. La bolsa del chocolate ha sido elaborada artesanalmente. No la tires, dale una nueva vida.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<ul>\r\n	<li>\r\n	<p>Delicioso chocolate hecho a mano por manos 100% mexicanas siguiendo la receta tradicional de la regi&oacute;n.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Lleva a tu mesa un producto natural y al mismo tiempo que disfrutas este delicioso chocolate, si&eacute;ntete feliz y orgulloso sabiendo que, con tu ayuda, muchas mujeres pueden continuar trabajando de forma honrada.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Cada&nbsp;bolsa contiene 5 tabletas de chocolate. Cada una alcanza para preparar cerca de un litro de leche o agua.</p>\r\n	</li>\r\n	<li>\r\n	<p>El peso aproximado del paquete es de 550 gramos.&nbsp;</p>\r\n	</li>\r\n</ul>\r\n', '', 'México', 'si', '', '', '', '', '', '', '200.00', '250.00', 'MXN', 'no', '3', 50, 1, 1, 'No disponible para la venta', '2019-08-29 01:03:25', '2019-08-29 01:03:25', '2019-08-29 01:03:25', '20.00', '17.00', '0.00', '0.70', '0.55', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(77, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Molinillos hechos y decorados a mano. Sin tinta. Envío gratis. ', 'molinillos-hechos-a-mano-sin-tinta', '<ul>\r\n	<li>Chocolate m..... y el molinillo ?&nbsp;</li>\r\n	<li>Aqu&iacute; est&aacute;, para que no te quedes sin espumar tu chocolate y disfrutarlo calientito en el desayuno o la cena.&nbsp;</li>\r\n	<li>Molinillos hechos a mano por artesanos de la regi&oacute;n de Cuetzalan, Puebla. No est&aacute;n entintados, el color de contraste se obtiene al quemar la madera, as&iacute; que no tienes que preocuparte porque se&nbsp; pierdan su adorno o porque haya sustancias qu&iacute;micas en contacto con tu chocolate.&nbsp;</li>\r\n	<li>El compa&ntilde;ero perfecto para nuestro delicioso chocolate oaxaque&ntilde;o.&nbsp;</li>\r\n	<li>Adqui&eacute;relo hoy mismo y prep&aacute;rate un delicioso chocolate, calientito y espumoso.&nbsp;</li>\r\n</ul>\r\n\r\n<p>NOTA. La bolsa del molinillo est&aacute; hecha a mano. Por favor no la tires, re usala y dale una nueva vida.&nbsp;</p>\r\n\r\n<p><strong>Env&iacute;o incluido.</strong></p>\r\n', '<ul>\r\n	<li>\r\n	<h3>Hermosos molinillos hechos a mano por artesanos de la regi&oacute;n de Cuetzalan, Puebla.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>El compa&ntilde;ero perfecto para nuestro chocolate artesanal oaxaque&ntilde;o.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>La madera no tiene colorantes, sino que est&aacute; quemada, por lo que no perder&aacute; su color ni desprender&aacute; ning&uacute;n tipo de sustancia en tu chocolate.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Espuma tu chocolate de forma tradicional y disfruta una taza de esta milenaria bebida.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Longitud aproximada del molinillo de 38&nbsp;cent&iacute;metros.&nbsp;</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Env&iacute;o incluido con Correos de M&eacute;xico.</h3>\r\n	</li>\r\n</ul>\r\n', '', 'México', 'si', '', '', '', '', '', '', '120.00', '0.00', 'MXN', 'no', '3', 45, 1, 1, 'No disponible para la venta', 