(99, '5d28f9009eba97.76133430', 14, 'Sales minerales exfoliantes', 'Sales minerales para baño. Producen un efecto relajante, energizante y activan la recuperación muscular gracias a las sales marinas y sus muchos minerales que a la vez desintoxican tu cuerpo. Puedes darte masaje en pies, manos, muslos o cualquier parte del cuerpo, es excelente remedio contra enfermedades articulares ya que calman las molestias por la inflamación. Tenemos cuatro aromas: pepino, lavanda, menta y romero.', 'Sales minerales exfoliantes para baño.', 'Sales minerales exfoliantes', 'sales-minerales-exfoliantes', '<p>Sales minerales para ba&ntilde;o. Producen un efecto relajante, energizante y activan la recuperaci&oacute;n muscular gracias a las sales marinas y sus muchos minerales que a la vez desintoxican tu cuerpo. Puedes darte masaje en pies, manos, muslos o cualquier parte del cuerpo s&oacute;lo mezclando las sales en una tina con agua, es excelente remedio contra enfermedades articulares ya que calman las molestias por la inflamaci&oacute;n. Tenemos cuatro aromas: pepino, lavanda, menta y romero.</p>\r\n', '<p>Sales minerales para ba&ntilde;o. Producen un efecto relajante, energizante y activan la recuperaci&oacute;n muscular gracias a las sales marinas y sus muchos minerales que a la vez desintoxican tu cuerpo. Puedes darte masaje en pies, manos, muslos o cualquier parte del cuerpo s&oacute;lo mezclando las sales en una tina con agua, es excelente remedio contra enfermedades articulares ya que calman las molestias por la inflamaci&oacute;n. Tenemos cuatro aromas: pepino, lavanda, menta y romero.</p>\r\n', '', 'México', 'si', '', '', '', '', '', '', '85.00', '90.00', 'MXN', 'no', 'no', 6, 1, 1, 'No disponible para la venta', '2019-08-23 21:33:58', '2019-08-23 21:33:58', '2019-08-23 21:33:58', '5.90', '8.50', '5.80', '0.12', '0.10', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(100, '5d28f9009eba97.76133430', 14, 'Mezcla de aceites herbales y florales para masaje y aromaterapia', 'Mezcla de aceites herbales y florales para masaje y aromaterapia en varias presentaciones.', 'Mezcla de aceites herbales y florales para masaje y aromaterapia en varias presentaciones.', 'Aceite para masaje', 'aceite-para-masaje', '<p>Mezclas especiales de aceites que te ayudar&aacute;n a consentirte cuando m&aacute;s lo necesites. Las presentaciones son:<br />\r\nAnti-estr&eacute;s / Naranja-canela: para ayudar a relajar cuerpo y mente con notas suaves que evocan tranquilidad y armon&iacute;a.<br />\r\nReconfortante / Neroly-manzanilla: para reconfortar el cuerpo cansado o con carga emocional, con notas florales que te reaniman.<br />\r\nConcentraci&oacute;n / Menta-jengibre: ayuda a la mente a enfocarse en las tareas y disciplinas diarias gracias a sus notas herbales.<br />\r\nArmon&iacute;a / Lavanda-lim&oacute;n: ofrece el balance perfecto entre energ&iacute;a y relajaci&oacute;n gracias a sus notas dulces y c&iacute;tricas.<br />\r\nTodos se pueden usar en masajes, con difusores, humidificadores o para agua de ba&ntilde;o.</p>\r\n', '<p>Mezclas especiales de aceites que te ayudar&aacute;n a consentirte cuando m&aacute;s lo necesites. Las presentaciones son:<br />\r\n<strong>Anti-estr&eacute;s / Naranja-canela</strong>: para ayudar a relajar cuerpo y mente con notas suaves que evocan tranquilidad y armon&iacute;a.<br />\r\n<strong>Reconfortante / Neroly-manzanilla</strong>: para reconfortar el cuerpo cansado o con carga emocional, con notas florales que te reaniman.<br />\r\n<strong>Concentraci&oacute;n / Menta-jengibre</strong>: ayuda a la mente a enfocarse en las tareas y disciplinas diarias gracias a sus notas herbales.<br />\r\n<strong>Armon&iacute;a / Lavanda-lim&oacute;n</strong>: ofrece el balance perfecto entre energ&iacute;a y relajaci&oacute;n gracias a sus notas dulces y c&iacute;tricas.<br />\r\nTodos se pueden usar en masajes, con difusores, humidificadores o para agua de ba&ntilde;o.</p>\r\n', '', 'México', 'si', '', '', '', '', '', '', '155.00', '160.00', 'MXN', 'no', 'no', 8, 1, 1, 'No disponible para la venta', '2019-08-23 21:39:22', '2019-08-23 21:39:22', '2019-08-23 21:39:22', '3.00', '8.00', '3.00', '0.50', '0.50', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(101, '5d28f9009eba97.76133430', 14, 'Arcilla verde y de carbón activado para mascarillas exfoliantes', 'Arcillas para una mascarilla que ayudará a tu piel a recobrar su lozanía natural.', 'Arcilla verde y de carbón activado para mascarillas exfoliantes', 'Arcillas para mascarillas', 'arcillas-para-mascarillas', '<p>Arcillas para una mascarilla que ayudar&aacute; a tu piel a recobrar su lozan&iacute;a natural.</p>\r\n', '<p><strong>Arcillas para una mascarilla</strong> que ayudar&aacute; a tu piel a recobrar su lozan&iacute;a natural.<br />\r\n<strong>Arcilla verde</strong>: es cicatrizante y eficaz en curar heridas o rozaduras, adem&aacute;s suaviza la piel con su efecto desintoxicante, recomendada para pieles grasas o con brotes de acn&eacute;.<br />\r\n<strong>Arcilla de carb&oacute;n activado</strong>: efectiva contra el exceso de grasa, pero incluso si no lo padeces, dejar&aacute; tu piel m&aacute;s limpia y tonificada tras su suave exfoliaci&oacute;n que desintoxica y limpia las impurezas a fondo. Ideal para todo tipo de piel.</p>\r\n', '', 'México', 'si', '', '', '', '', '', '', '65.00', '68.00', 'MXN', 'no', 'no', 8, 1, 1, 'No disponible para la venta', '2019-08-23 21:47:14', '2019-08-23 21:47:14', '2019-08-23 21:47:14', '3.00', '9.30', '3.00', '0.60', '0.60', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(102, '5d28f9009eba97.76133430', 14, 'Shampoo sólido', 'Shampoo sólido para humectar la piel del cuero cabelludo, nutrir y propiciar el crecimiento del cabello.', 'Shampoo sólido para humectar la piel del cuero cabelludo, nutrir y propiciar el crecimiento del cabello.', 'Shampoo sólido', 'shampoo-sólido', '<p><strong>Shampoo s&oacute;lido con aceite de Arg&aacute;n</strong> que tiene alto contenido de omega 3 y vitamina E que refuerzan tu cabello evitando la ca&iacute;da, tambi&eacute;n le da brillo y lo deja sedoso y manejable.&nbsp;<strong>Shampoo con aceite de Germen de trigo </strong>que es una fuente de &aacute;cidos grasos escenciales para la reparaci&oacute;n del cabello da&ntilde;ado, con prote&iacute;nas y antioxidantes que combaten la resequedad del cuero cabelludo. <strong>Shampoo con aceite de Jojoba</strong> que contiene ceramidas que ayudan a la hidrataci&oacute;n profunda del cuero cabelludo y balancean su PH. Adem&aacute;s, sus antioxidantes reducen el da&ntilde;o causado por radicales libres. Todos est&aacute;n enriquecidos con Keratina, prote&iacute;na encargada de aportar el brillo y color al cabello, adem&aacute;s de restaurarlo, dar volumen y recuperar sus nutrientes naturales. No te pierdas de los beneficios que nuestro shampoo te ofrece.</p>\r\n', '<p><strong>Shampoo s&oacute;lido con aceite de Arg&aacute;n</strong> que tiene alto contenido de omega 3 y vitamina E que refuerzan tu cabello evitando la ca&iacute;da, tambi&eacute;n le da brillo y lo deja sedoso y manejable.&nbsp;<strong>Shampoo con aceite de Germen de trigo </strong>que es una fuente de &aacute;cidos grasos escenciales para la reparaci&oacute;n del cabello da&ntilde;ado, con prote&iacute;nas y antioxidantes que combaten la resequedad del cuero cabelludo. <strong>Shampoo con aceite de Jojoba</strong> que contiene ceramidas que ayudan a la hidrataci&oacute;n profunda del cuero cabelludo y balancean su PH. Adem&aacute;s, sus antioxidantes reducen el da&ntilde;o causado por radicales libres. Todos est&aacute;n enriquecidos con Keratina, prote&iacute;na encargada de aportar el brillo y color al cabello, adem&aacute;s de restaurarlo, dar volumen y recuperar sus nutrientes naturales. No te pierdas de los beneficios que nuestro shampoo te ofrece.</p>\r\n', '', 'México', 'si', '', '', '', '', '', '', '58.00', '60.00', 'MXN', 'no', 'no', 9, 1, 1, 'No disponible para la venta', '2019-08-23 21:53:23', '2019-08-23 21:53:23', '2019-08-23 21:53:23', '6.40', '3.30', '6.40', '0.10', '0.10', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
