(104, '5d28f9009eba97.76133430', 14, 'Crema orgánica corporal sólida de fácil absorción.', 'Crema orgánica corporal sólida. Con aceite de pepino o con aceite de almendras, enriquecidas con colágeno hidrolizado que dará elasticidad a tu piel, agua de rosas para matificar, extractos herbales y aceites naturales que le dan una protección extra suave a tu piel. Sin petrolatos, sin parabenos, sin alcohol. De fácil absorción, pero nunca dejando de lado la humectación y la frescura que tu cuerpo merece. ', 'Crema orgánica corporal sólida de fácil absorción.', 'Crema orgánica corporal sólida', 'crema-orgánica-corporal-sólida', '<p>Crema&nbsp;org&aacute;nica&nbsp;corporal&nbsp;s&oacute;lida. Con aceite de pepino o con aceite de almendras, enriquecidas con col&aacute;geno hidrolizado que dar&aacute; elasticidad a tu piel, agua de rosas para matificar, extractos herbales y aceites naturales que le dan una protecci&oacute;n extra suave a tu piel. Sin petrolatos, sin parabenos, sin alcohol. De f&aacute;cil absorci&oacute;n, pero nunca dejando de lado la humectaci&oacute;n y la frescura que tu cuerpo merece.&nbsp;</p>\r\n', '<p><strong>Crema org&aacute;nica corporal s&oacute;lida.</strong> <strong>Con aceite de pepino o con aceite de almendras</strong>, enriquecidas con <strong>col&aacute;geno hidrolizado</strong> que dar&aacute; elasticidad a tu piel, <strong>agua de rosas</strong> para matificar, <strong>extractos herbales y aceites naturales</strong> que le dan una protecci&oacute;n extra suave a tu piel. Sin petrolatos, sin parabenos, sin alcohol. De f&aacute;cil absorci&oacute;n, pero nunca dejando de lado la humectaci&oacute;n y la frescura que tu cuerpo merece.</p>\r\n', '', 'México', 'si', '', '', '', '', '', '', '80.00', '87.00', 'MXN', 'no', 'no', 8, 1, 1, 'No disponible para la venta', '2019-08-23 22:03:18', '2019-08-23 22:03:18', '2019-08-23 22:03:18', '6.50', '5.20', '6.50', '0.13', '0.11', 'normal', 'nuevo', 0, '0.00', 'es', 'activo', 1),
(105, '5d28f9009eba97.76133430', 14, 'Gel exfoliante de café y carbón activado', 'Gel exfoliante de café y carbón activado. Hecho con café orgánico chiapaneco que es fuente de antioxidantes que eliminan las células muertas dejando la piel suave, radiante e hidratada. Además, ayuda a combatir la celulitis y la piel de naranja, dando un efecto rejuvenecedor. Y gracias al carbón activado, te proporcionará una limpieza profunda ayudándote a eliminar bacterias y evitando el acné. Es ideal para rostro y cuerpo.', 'Gel exfoliante de café y carbón activado, orgánico y de fácil aplicación para una exfoliación suave y limpieza profunda.', 'Gel exfoliante de café y carbón activado', 'gel-exfoliante-de-café-y-carbón-activado', '<p>Gel exfoliante de caf&eacute; y carb&oacute;n activado. Hecho con caf&eacute; org&aacute;nico chiapaneco&nbsp;que es fuente de antioxidantes que eliminan las c&eacute;lulas muertas dejando la piel suave, radiante e hidratada. Adem&aacute;s, ayuda a combatir la celulitis y la piel de naranja, dando un efecto rejuvenecedor. Y gracias al carb&oacute;n activado, te proporcionar&aacute; una limpieza profunda ayud&aacute;ndote a eliminar bacterias y evitando el acn&eacute;. Es ideal para rostro y cuerpo.</p>\r\n', '<p><strong>Gel exfoliante de caf&eacute; y carb&oacute;n activado</strong>. Hecho con <strong>caf&eacute; org&aacute;nico chiapaneco</strong>&nbsp;que es fuente de antioxidantes que eliminan las c&eacute;lulas muertas dejando la piel suave, radiante e hidratada. Adem&aacute;s, ayuda a combatir la celulitis y la piel de naranja, dando un efecto rejuvenecedor. Y gracias al carb&oacute;n activado, te proporcionar&aacute; una limpieza profunda ayud&aacute;ndote a eliminar bacterias y evitando el acn&eacute;. Es ideal para rostro y cuerpo.</p>\r\n', '', 'México', 'si', '', '', '', '', '', '', '70.00', '75.00', 'MXN', 'no', 'no', 5, 1, 1, 'No disponible para la venta', '2019-08-23 22:15:20', '2019-08-23 22:15:20', '2019-08-23 22:15:20', '6.00', '5.50',