(109, '5c9c1ff62ce0c3.78174962', 1, 'Porcelana japonesa Midnight Rose. Hermoso set de 6 tazas para café expreso con borde de platino.', 'Elegante juego de tazas y platos de porcelana con filo de platino, fabricadas en Japón. Un magnifico regalo para un regalo de bodas o para un amante del café. ', 'porcelana fina, porcelana japonesa, tazas de porcelana fina, porcelana fina con borde de platino, tazas de porcelana con borde de platino, ', 'Juego de 6 tazas de porcelana japonesa modelo Midnight Rose HC-100. Piezas originales.  ', 'juego-de-6-tazas-de-porcelana-japonesa-modelo-midnight-rose-hc-100-piezas-originales', '<ul>\r\n	<li>Juego de 6 tazas con plato de la marca Hope Chest&nbsp;modelo Midnight Rose HC-100.&nbsp;</li>\r\n	<li>Hermosas tazas y platos de porcelana japonesa con borde de platino.&nbsp;</li>\r\n	<li>El accesorio perfecto para cualquier mesa elegante y distinguida.&nbsp;</li>\r\n	<li>Fabricados en Jap&oacute;n, estas piezas tienen la elegancia, delicadeza y belleza que realza cualquier mesa o vitrina.&nbsp;</li>\r\n	<li>Durables, resistentes y elegantes.&nbsp;</li>\r\n	<li>Producto 100% nuevo, jamas han sido usados.&nbsp;</li>\r\n	<li>Env&iacute;o gratis.&nbsp;</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Distinguido producto fabricado en Jap&oacute;n.&nbsp;</li>\r\n	<li>Deja boquiabierto a cualquiera al obsequiarle este hermoso y distinguido regalo.&nbsp;</li>\r\n	<li>El producto es totalmente nuevo.&nbsp;</li>\r\n	<li>Las tazas tiene cerca de 57 mililitros de capacidad. El plato mide aproximadamente 12.2 cm de di&aacute;metro.&nbsp;</li>\r\n	<li>Con este regalo no hay forma de que quedes mal.&nbsp;</li>\r\n	<li>Envio gratis con Mexpost&nbsp;</li>\r\n</ul>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '1199.00', '2000.00', 'MXN', 'no', '37', 1, 1, 1, 'No disponible para la venta', '2019-08-30 23:15:47', '2019-08-30 23:15:47', '2019-08-30 23:15:47', '6.50', '5.50', '0.00', '1.60', '1.13', 'normal', 'nuevo', 0, '0.00', 'es', 'inactivo', 1),
(110, '5c9c1ff62ce0c3.78174962', 1, '', '', '', 'Cafetera italiana de acero inoxidable para 4 tazas de café expreso. Ideal para ese café matutino indispensable para comenzar el día.  ', 'cafetera-italiana-de-acero-inoxidable-para-4-tazas-de-cafe-expreso-ideal-para-ese-cafe-matutino-indispensable-para-comenzar-el-dia', '', '', '', 'México', 'no', '', '', '', '', '', '', '400.00', '0.00', 'MXN', 'no', '3', 1, 1, 1, 'No disponible para la venta', '2019-08-30 23:58:49', '2019-08-30 23:58:49', '2019-08-30 23:58:49', '1.00', '1.00', '1.00', '0.60', '0.34', 'normal', 'nuevo', 0, '0.00', 'es', 'inactivo', 1),
(111, '5c9c1ff62ce0c3.78174962', 1, 'Pocillo de acero inoxidable para calentar cualquier liquido. Para uso rudo', '', 'pocillo de acero inoxidable, pocillo para leche, pocillo para uso rudo, pocillo para calentar café, pocillo para calentar agua, pocillo para cafetería,  ', 'Pocillo para calentar líquidos y preparar tu bebida favorita marca Carico. Elaborado en acero inoxidable. ', 'pocillo-para-calentar-liquidos-y-preparar-tu-bebida-favorita-marca-carico-elaborado-en-acero-inoxidable', '', '<p>This 1-quart stainless steel pan is the ideal pan for warming milk for coffee and tea.<br />\r\nGreat for gravies, sauces, custards, and melting butter and chocolate&hellip; the uses are endless!</p>\r\n\r\n<p>The flared lip is designed for drip-free pouring and the phenolic handle has a comfortable grip.</p>\r\n', '', 'Otro', 'no', '', '', '', '', '', '', '640.00', '0.00', 'MXN', 'no', '3', 1, 1, 1, 'No disponible para la venta', '2019-08-31 00:30:55', '2019-08-31 00:30:55', '2019-08-31 00:30:55', '1.00', '1.00', '1.00', '0.70', '0.39', 'normal', 'nuevo', 0, '0.00', 'es', 'inactivo', 1),
(112, '5c9c1ff62ce0c3.78174962', 1, 'Bolsa de tela Origami. Ideal para trasportar tus compras todos los días. ', 'Bolsa de tela 100% algodón para que evites el uso de bolsas plásticas. Ayudemos al ambiente. ', 'bolsa de tela origami, bolsa de tela para el super, bolsa ecológica, ', 'Bolsa Origami japones en tela 100% algodón, Ideal para cargar tus compras del supermercado.', 'bolsa-origami-japones-en-tela-100-algodon-ideal-para-cargar-tus-compras-del-supermercado', '<ul>\r\n	<li>Bolsa de tela modelo Origami. Una elegante soluci&oacute;n para reducir el uso de pl&aacute;sticos al momento de realizar tus compras.&nbsp;</li>\r\n	<li>Fabricada con algod&oacute;n 100% esta hermosa bolsa es muy liviana y practica.</li>\r\n	<li>La tela es muy suave y puedes plegarla sin dificultad para poder llevarla contigo en tu bolsa de mano, tu mochila o tu cartera.&nbsp;</li>\r\n	<li>Su forma le brinda una gran capacidad que te permitir&aacute; transportar tus compras f&aacute;cilmente.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '<ul>\r\n	<li>Fabricada en tela 100% algod&oacute;n.&nbsp;</li>\r\n	<li>Lavable en lavadora.&nbsp;</li>\r\n	<li>F&aacute;cil de doblar y guardar.&nbsp;</li>\r\n	<li>Gran capacidad, mide 52 x 25 x 12 cm.&nbsp;</li>\r\n	<li>Env&iacute;o gratis con Correos de M&eacute;xico.</li>\r\n</ul>\r\n', '', 'México', 'si', '', '', '', '', '', '', '1.00', '0.00', 'MXN', 'no', '3', 1, 1, 1, 'No disponible para la venta', '2019-09-03 23:12:06', '2019-09-03 23:12:06', '2019-09-03 23:12:06', '52.00', '25.00', '12.00', '0.25', '0.10', 'normal', 'nuevo', 0, '0.00', 'es', 'inactivo', 1),
(113, '5c9c1ff62ce0c3.78174962', 1, 'Bolsas reutilizables de tela, lavables, fabricadas en algodón. ', 'Hermosa bolsa reutilizable modelo vintage para que la lleves contigo a todas tus compras sin necesidad de usar bolsas plásticas. ', 'bolsas de tela reutilizables, bolsas de tela para compras, bolsas de tela ecológicas, ', 'Bolsas reutilizables de tela para que realices tus compras sin necesidad de usar plástico. ', 'bolsas-reutilizables-de-tela-para-que-realices-tus-compras-sin-necesidad-de-usar-plastico', '<ul>\r\n	<li>Apoya la disminuci&oacute;n en el uso de bolsas pl&aacute;sticas sin tener que sacrificar tu estilo, con esta hermosa bolsa fabricada en loneta.&nbsp;</li>\r\n	<li>Gran capacidad, hermoso estampado y dise&ntilde;o de moda.&nbsp;</li>\r\n	<li>No dejes de ser fashion aun al realizar tus compras.&nbsp;</li>\r\n	<li>Hermosa tela vintage&nbsp;muy combinable.&nbsp;</li>\r\n	<li>De fabricaci&oacute;n casera.&nbsp;</li>\r\n	<li>Env&iacute;o&nbsp;gratis.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<ul>\r\n	<li>Totalmente fabricada en loneta.&nbsp;</li>\r\n	<li>F&aacute;cil de lavar, ideal para lavadora ya que es una tela de algod&oacute;n.&nbsp;</li>\r\n	<li>Con gran capacidad, muy amplia.&nbsp;</li>\r\n	<li>Viene con broche en la parte frontal para que puedas cerrarla f&aacute;cilmente.</li>\r\n	<li>Tiene un bolsillo interior para que guardes tus llaves y tu cartera.&nbsp;</li>\r\n	<li>Env&iacute;o gratis con Correos de M&eacute;xico.&nbsp;</li>\r\n</ul>\r\n', '', 'México', 'si', '', '', '', '', '', '', '0.00', '0.00', 'MXN', 'no', '3', 1, 1, 1, 'No disponible para la venta', '2019-09-03 23:59:06', '2019-09-03 23:59:06', '2019-09-03 23:59:06', '43.00', '38.50', '13.00', '0.30', '0.15', 'normal', 'nuevo', 0, '0.00', 'es', 'inactivo', 1),
(114, '5c9c1ff62ce0c3.78174962', 1, 'Bolsa de tela reutilizables, la opcion perfecta para disminuir tu uso de bolsas plásticas. ', 'Hermosa bolsa reutilizable modelo vintage para que la lleves contigo a todas tus compras sin necesidad de usar bolsas plásticas. ', 'bolsas de tela reutilizables, bolsas de tela para compras, bolsas de tela ecológicas,', 'Bolsa reutilizable de tela ideal para hacer tus compras y llevarla contigo a todos lados. ', 'bolsa-reutilizable-de-tela-ideal-para-hacer-tus-compras-y-llevarla-contigo-a-todos-lados', '<ul>\r\n	<li>Apoya la disminuci&oacute;n en el uso de bolsas pl&aacute;sticas sin tener que sacrificar tu estilo, con esta hermosa bolsa fabricada en loneta.&nbsp;</li>\r\n	<li>Gran capacidad, hermoso estampado y dise&ntilde;o de moda.&nbsp;</li>\r\n	<li>No dejes de ser fashion aun al realizar tus compras.&nbsp;</li>\r\n	<li>Hermosa tela vintage&nbsp;muy combinable.&nbsp;</li>\r\n	<li>De elaboraci&oacute;n casera.&nbsp;</li>\r\n	<li>Envio gratis.&nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>\r\n', '<ul>\r\n	<li>Totalmente fabricada en loneta.&nbsp;</li>\r\n	<li>F&aacute;cil de lavar, ideal para lavadora ya que es una tela de algod&oacute;n.&nbsp;</li>\r\n	<li>Con gran capacidad, muy amplia.&nbsp;</li>\r\n	<li>Viene con dos broches interiores para que se cierre y abra f&aacute;cilmente.</li>\r\n	<li>Tiene un bolsillo interior para que encuentres tus llaves y tu cartera.&nbsp;</li>\r\n	<li>Env&iacute;o gratis con Correos de M&eacute;xico.&nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>\r\n', '', 'México', 'si', '', '', '', '', '', '', '1.00', '1.00', 'MXN', 'no', '3', 1, 1, 1, 'No disponible para la venta', '2019-09-04 00:08:14', '2019-09-04 00:08:14', '2019-09-04 00:08:14', '42.00', '37.50', '12.00', '0.30', '0.12', 'normal', 'nuevo', 0, '0.00', 'es', 'inactivo', 1);
