\r\n\r\n<p>** El costo del almacenaje va de acuerdo a la cantidad de espacio que tu producto necesite.</p>\r\n\r\n<p>1 El costo de estos dos rubros depende del tipo de pago que escoge el cliente, as&iacute; como del servicio de mensajer&iacute;a seleccionado. Por esta raz&oacute;n, los costos se se&ntilde;alan m&aacute;s el IVA correspondiente.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Para el servicio de anuncios para venta o renta de autom&oacute;viles y bienes ra&iacute;ces favor de comunicarse a <a href=\"mailto:atencionclientes@abanicoytu.com\">atencionclientes@abanicoytu.com</a></strong></p>\r\n\r\n<p><strong>Costos para oferta de servicios</strong></p>\r\n\r\n<p>Todos los precios abajo listados <strong>ya incluyen el IVA</strong>.</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>\r\n			<p>Incluye</p>\r\n			</td>\r\n			<td>\r\n			<p>Espacio ocupado</p>\r\n			</td>\r\n			<td>\r\n			<p>Costo</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>An&uacute;nciate con nosotros</p>\r\n			</td>\r\n			<td>\r\n			<p>Mensualidad. Descripci&oacute;n de tu servicio y zona donde se realiza. Mantenimiento del perfil.</p>\r\n			</td>\r\n			<td>\r\n			<p>Tu anuncio comparte el espacio con otros anunciantes de la misma categor&iacute;a.</p>\r\n			</td>\r\n			<td>\r\n			<p>$ 200.00</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Paquete completo</p>\r\n			</td>\r\n			<td>\r\n			<p>Mensualidad. Descripci&oacute;n detallada de tu servicio y zona donde se realiza. Mantenimiento del perfil. Incluye la presentaci&oacute;n de fotos y/o videos*, as&iacute; como de documentos relevantes para que tus clientes potenciales te conozcan.</p>\r\n			</td>\r\n			<td>\r\n			<p>Tu anuncio se presenta de manera individual en una p&aacute;gina dentro de la categor&iacute;a asignada.</p>\r\n			</td>\r\n			<td>\r\n			<p>$500.00</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Paquete de lujo</p>\r\n			</td>\r\n			<td>\r\n			<p>Dise&ntilde;amos tu anuncio de acuerdo a tus necesidades.</p>\r\n			</td>\r\n			<td>\r\n			<p>Se define seg&uacute;n tus requerimientos.</p>\r\n			</td>\r\n			<td>\r\n			<p>El costo se define de acuerdo a tus requerimientos.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>*Esta informaci&oacute;n debe de ser entregada por el cliente para ser anexados en el sitio.</p>\r\n\r\n<p><strong><em>ENV&Iacute;O DE PRODUCTOS</em></strong></p>\r\n\r\n<p>Una vez que se ha recibido la confirmaci&oacute;n de la orden de pago comienza a correr el tiempo de entrega del producto. Al momento de realizarse la entrega del producto en el domicilio registrado ser&aacute; necesario que el comprador o la persona que recibe se identifique con un documento oficial (credencial para votar, pasaporte, forma migratoria de ser el caso).</p>\r\n\r\n<p>El comprador puede elegir entre 3 tipos de env&iacute;os:</p>\r\n\r\n<ol>\r\n	<li>Entrega normal. Con un plazo de entrega de 4 a 10 d&iacute;as h&aacute;biles posteriores a la confirmaci&oacute;n de recepci&oacute;n de la orden.</li>\r\n	<li>Entrega Express. Con un plazo de entrega de 2 a 4 d&iacute;as h&aacute;biles posteriores a la confirmaci&oacute;n de recepci&oacute;n de la orden.</li>\r\n	<li>Entrega Especial. Con un plazo de entrega del mismo d&iacute;a h&aacute;bil hasta el d&iacute;a siguiente posterior a la confirmaci&oacute;n de la entrega de la orden. Esta entrega requiere que el monto del producto haya sido liquidado al momento de hacer el pedido. Las entregas &uacute;nicamente se realizar&aacute;n en direcciones establecidas (casa habitaci&oacute;n, oficina o comercio), en ning&uacute;n caso las entregas se realizar&aacute;n en lugares p&uacute;blicos. El &aacute;rea de cobertura se limita a la Ciudad de M&eacute;xico y el &Aacute;rea Metropolitana con algunas excepciones. Si la opci&oacute;n de Entrega Especial no se despliega al momento de capturar la informaci&oacute;n correspondiente al m&eacute;todo de pago y tipo de entrega significa que a&uacut