entrega de los productos se realizar&aacute; a la entrada del domicilio indicado y no incluye ning&uacute;n tipo de movimiento de mudanza.</p>\r\n\r\n<p>ABANICO puede rechazar o suspender el transporte de cualquier producto o mercanc&iacute;a cuando:</p>\r\n\r\n<ol>\r\n	<li>La informaci&oacute;n del remitente y destinatario este incompleta, no sea correcta o que los productos no correspondan a los registrados para su entrega.</li>\r\n	<li>Cuando los materiales contenidos en el paquete puedan da&ntilde;ar otros paquetes o representen un peligro un riesgo para el equipo o empleados de ABANICO o de sus prestadores de servicios.</li>\r\n	<li>Que el paquete no se encuentre debidamente embalado para su transporte.</li>\r\n	<li>Que el paquete no incluya la gu&iacute;a de env&iacute;o con todos los datos tanto del remitente como del destinatario.</li>\r\n	<li>Que el peso, volumen y/o apariencia del empaque no coincidan con los descritos en la gu&iacute;a de env&iacute;o.</li>\r\n</ol>\r\n\r\n<p>Con el objetivo de verificar lo anterior, ABANICO se reserva el derecho de inspeccionar todos los paquetes o de permitir a las autoridades competentes llevar a cabo las inspecciones adecuadas.</p>\r\n\r\n<p>Si llegamos a detectar que los VENDEDORES(AS) est&aacute;n haciendo mal uso de los m&eacute;todos de entrega de ABANICO al falsear la informaci&oacute;n referente al peso, volumen o cantidad de productos que ser&aacute;n enviados ABANICO considerar&aacute; que est&aacute;n faltando a los presentes T&eacute;rminos de Servicio y deber&aacute;n cubrir los costos del traslado desde el punto de recolecci&oacute;n hasta la bodega de ABANICO y de vuelta hacia el punto de recolecci&oacute;n. Adem&aacute;s, los VENDEDORES(AS) deber&aacute;n cubrir el cargo por generaci&oacute;n de la gu&iacute;a liquidando el costo real que debi&oacute; de ser cobrado de acuerdo al peso y n&uacute;mero de productos sin tener derecho al descuento en la tarifa que ABANICO ofrece.</p>\r\n\r\n<p>En caso de que estos costos no sean cubiertos con el saldo que los VENDEDORES(AS) tengan se requerir&aacute; su pago en un periodo no mayor a 10 d&iacute;as naturales a partir de la notificaci&oacute;n de la penalizaci&oacute;n. De no realizarse el pago en este plazo la tienda ser&aacute; dado de baja inmediatamente de la p&aacute;gina y la mercanc&iacute;a quedar&aacute; a consignaci&oacute;n de ABANICO. En este caso los VENDEDORES(AS) no podr&aacute;n ejercer acci&oacute;n legal alguna en contra de ABANICO que implique la devoluci&oacute;n, indemnizaci&oacute;n o reposici&oacute;n de los productos.</p>\r\n\r\n<p><strong><em>CAMBIOS Y DEVOLUCIONES</em></strong></p>\r\n\r\n<p>Los gastos derivados de las devoluciones ser&aacute;n cubiertos por los VENDERORES(AS).</p>\r\n\r\n<p><strong><em>EXACTITUD, EXHAUSTIVIDAD Y ACTUALIDAD DE LA INFORMACI&Oacute;N</em></strong></p>\r\n\r\n<p>A pesar de que intentamos hacer una revisi&oacute;n exhaustiva de todo el material que ingresa a nuestra p&aacute;gina, no nos hacemos responsables si la informaci&oacute;n disponible en este sitio no es exacta, completa o actual. El material en este sitio es provisto solo para informaci&oacute;n general y no debe confiarse en ella o utilizarse como la &uacute;nica base para la toma de decisiones sin consultar, primeramente, informaci&oacute;n m&aacute;s precisa, completa u oportuna. Los VENDEDORES(AS) tienen la obligaci&oacute;n de detallar lo m&aacute;s posible las caracter&iacute;sticas de sus productos, as&iacute; como de presentar la informaci&oacute;n gr&aacute;fica y textual m&aacute;s clara y precisa de los mismos. Los VENDEDORES(AS) deber&aacute;n responder a todas las preguntas o solucionar las dudas que EL COMPRADOR externe a trav&eacute;s de nuestra secci&oacute;n de preguntas. De detectarse que los VENDEDORES(AS) no est&aacute;n respondiendo las inquietudes de EL COMPRADOR la p&aacute;gina ser&aacute; dada de baja por un per&iacute;odo de 8 d&iacute;as naturales.</p>\r\n\r\n<p><strong><em>MODIFICACIONES AL SERVICIO Y PRECIOS</em></strong></p>\r\n\r\n<p>Los precios de nuestros servicios para los VENDEDORES(AS)/PRESTADORES(AS) est&aacute;n sujetos a cambio o modificaciones, mismos que ser&aacute;n dados a conocer con al menos 30 d&iacute;as naturales previos a la implementaci&oacute;n de los mismos. De igual modo, nos reservamos el derecho de modificar o discontinuar el servicio (o cualquier parte del contenido) en cualquier momento sin aviso previo. Por lo anterior, no seremos responsables ante ti o alguna tercera parte por cualquier modificaci&oacute;n, cambio de precio, suspensi&oacute;n o discontinuidad del Servicio.</p>\r\n\r\n<p><strong><em>PRODUCTOS Y/O SERVICIOS</em></strong></p>\r\n\r\n<p>Es responsabilidad de los VENDEDOR(ES)/PRESTADORES(AS) mantener actualizado el inventario de sus productos y su informaci&oacute;n de contacto en la p&aacute;gina cuando no se encuentren bajo el esquema de contrataci&oacute;n de los servicios de almacenaje y entrega de ABANICO. De no mantener la informaci&oacute;n al d&iacute;a ABANICO dar&aacute; de baja la publicaci&oacute;n por un per&iacute;odo de 7 d&iacute;as naturales.</p>\r\n\r\n<p><strong><em>EXCLUSI&Oacute;N DE GARANT&Iacute;AS Y LIMITACI&Oacute;N DE RESPONSABILIDAD</em></strong></p>\r\n\r\n<p>No garantizamos ni aseguramos que el uso de nuestro servicio ser&aacute; ininterrumpido, puntual, seguro o libre de errores. No garantizamos que los resultados que se puedan obtener del uso del servicio ser&aacute;n exactos o confiables. Aceptas que de manera ocasional podemos quitar el servicio por per&iacute;odos indefinidos o cancelar el servicio en cualquier momento sin previo aviso. Aceptas expresamente que el uso de, o la posibilidad de utilizar, el servicio es bajo tu propio riesgo. Los productos y servicios proporcionados a trav&eacute;s del servicio son (salvo lo expresamente manifestado por nosotros) proporcionados &quot;de la forma en que se presentan&quot; y &quot;de acuerdo a su disponibilidad&quot; para su uso, sin ning&uacute;n tipo de representaci&oacute;n, garant&iacute;as o condiciones, ya sea expresa o impl&iacute;cita, incluidas todas las garant&iacute;as o condiciones impl&iacute;citas de comercializaci&oacute;n, calidad comercializable, la aptitud para un prop&oacute;sito particular, durabilidad, t&iacute;tulo y no infracci&oacute;n.</p>\r\n\r\n<p>En ning&uacute;n caso Abanico Siempre lo mejor S.A. de C.V., nuestros directores, funcionarios, empleados, afiliados, agentes, contratistas, internos, proveedores, prestadores de servicios o licenciantes ser&aacute;n responsables por cualquier da&ntilde;o, p&eacute;rdida, reclamo, o da&ntilde;os directos, indirectos, incidentales, punitivos, especiales o consecuentes de cualquier tipo, incluyendo, sin limitaci&oacute;n, p&eacute;rdida de beneficios, p&eacute;rdida de ingresos, p&eacute;rdida de ahorros, p&eacute;rdida de datos, costos de reemplazo, o cualquier da&ntilde;o similar, ya sea basado en contrato, agravio (incluyendo negligencia), responsabilidad estricta o de otra manera, como consecuencia del uso de cualquiera de los servicios o productos adquiridos mediante el servicio, o por cualquier otro reclamo relacionado de alguna manera con el uso del servicio o cualquier producto, incluyendo pero no limitado, a cualquier error u omisi&oacute;n en cualquier contenido, o cualquier p&eacute;rdida o da&ntilde;o de cualquier tipo incurridos como resultado de la utilizaci&oacute;n del servicio o cualquier contenido (o producto) publicado, transmitido, o que se pongan a disposici&oacute;n a trav&eacute;s del servicio, incluso si se avisa de su posibilidad. Debido a que algunos estados o jurisdicciones no permiten la exclusi&oacute;n o la limitaci&oacute;n de responsabilidad por da&ntilde;os consecuenciales o incidentales, en tales estados o jurisdicciones, nuestra responsabilidad se limitar&aacute; en la medida m&aacute;xima permitida por la ley.</p>\r\n\r\n<p><strong><em>INDEMNIZACI&Oacute;N</em></strong></p>\r\n\r\n<p>Los VENDEDORES(AS) aceptan indemnizar, defender y mantener indemne a Abanico Siempre lo mejor S.A. de C.V. y nuestras matrices, subsidiarias, afiliados, socios, funcionarios, directores, agentes, contratistas, concesionarios, proveedores de servicios, subcontratistas, proveedores, internos y empleados, de cualquier reclamo o demanda, incluyendo honorarios razonables de abogados, hechos por cualquier tercero a causa o como resultado de su incumplimiento de las Condiciones de Servicio o de los documentos que incorporan como referencia, o la violaci&oacute;n de cualquier ley o de los derechos de un tercero.</p>\r\n\r\n<p><strong><em>COMENTARIOS DE USUARIO, CAPTACI&Oacute;N Y OTROS ENV&Iacute;OS</em></strong></p>\r\n\r\n<p>Si, a solicitud nuestra, env&iacute;as ciertas presentaciones espec&iacute;ficas (por ejemplo, la participaci&oacute;n en concursos) o sin una solicitud de nuestra parte env&iacute;as ideas creativas, sugerencias, proposiciones, planes, u otros materiales, ya sea en l&iacute;nea, por email, por correo postal, o de otra manera (colectivamente, &#39;comentarios&#39;), aceptas que podamos, en cualquier momento, sin restricci&oacute;n, editar, copiar, publicar, distribuir, traducir o utilizar por cualquier medio comentarios que nos hayas enviado. No tenemos ni tendremos ninguna obligaci&oacute;n de mantener ning&uacute;n comentario confidencialmente, de pagar compensaci&oacute;n por comentarios o de responder a comentarios.</p>\r\n\r\n<p>Nosotros podemos, pero no tenemos obligaci&oacute;n de, monitorear, editar o remover contenido que consideremos sea ileg&iacute;timo, ofensivo, amenazante, calumnioso, difamatorio, pornogr&aacute;fico, obsceno u objetable o viole la propiedad intelectual de cualquiera de las partes o los T&eacute;rminos de Servicio.</p>\r\n\r\n<p>Aceptas que tus comentarios no violar&aacute;n los derechos de terceras partes, incluyendo derechos de autor, marca, privacidad, personalidad u otros derechos personales o de propiedad. Asimismo, aceptas que tus comentarios no contienen material difamatorio o ilegal, abusivo u obsceno, o contienen virus inform&aacute;ticos u otro malware que pudiera, de alguna manera, afectar el funcionamiento del Servicio o de cualquier sitio web relacionado. No puedes utilizar una direcci&oacute;n de correo electr&oacute;nico falsa, usar otra identidad que no sea leg&iacute;tima, o enga&ntilde;ar a terceras partes o a nosotros en cuanto al origen de tus comentarios. T&uacute; eres el &uacute;nico responsable por los comentarios que haces y su precisi&oacute;n. No nos hacemos responsables y no asumimos ninguna obligaci&oacute;n con respecto a los comentarios publicados por ti o cualquier tercer parte.</p>\r\n\r\n<p><strong><em>ERRORES, INEXACTITUDES Y OMISIONES</em></strong></p>\r\n\r\n<p>De vez en cuando puede haber informaci&oacute;n en nuestro sitio que contiene errores tipogr&aacute;ficos, inexactitudes u omisiones que puedan estar relacionadas con las descripciones de productos, precios, promociones, ofertas, gastos de env&iacute;o del producto, el tiempo de tr&aacute;nsito y la disponibilidad. Nos reservamos el derecho de corregir los errores, inexactitudes u omisiones y de cambiar o actualizar la informaci&oacute;n o cancelar pedidos si alguna informaci&oacute;n en el Servicio o en cualquier sitio web relacionado es inexacta en cualquier momento sin previo aviso (incluso despu&eacute;s de que hayas enviado tu orden).</p>\r\n\r\n<p>No asumimos ninguna obligaci&oacute;n de actualizar, corregir o aclarar la informaci&oacute;n incluyendo, sin limitaci&oacute;n, la informaci&oacute;n de precios, excepto cuando sea requerido por la ley. Ninguna especificaci&oacute;n actualizada o fecha de actualizaci&oacute;n aplicada en EL Servicio o en cualquier sitio web relacionado, debe ser tomada como una indicaci&oacute;n de que todo el contenido ha sido modificado o actualizado.</p>\r\n\r\n<p><strong><em>RESCISI&Oacute;N</em></strong></p>\r\n\r\n<p>Las obligaciones y responsabilidades de las partes que hayan incurrido con anterioridad a la fecha de terminaci&oacute;n sobrevivir&aacute;n a la terminaci&oacute;n de este acuerdo a todos los efectos.</p>\r\n\r\n<p>Estas Condiciones de servicio son efectivos a menos que y hasta que sea finalizado por ti o nosotros. Puedes finalizar cualquier relaci&oacute;n con nosotros en cualquier momento comunic&aacute;ndote directamente al tel&eacute;fono ___________ y se&ntilde;alando que ya no deseas utilizar nuestros servicios.</p>\r\n\r\n<p>Si a nuestro juicio, fallas o se sospecha que has fallado en el cumplimiento de cualquier t&eacute;rmino o disposici&oacute;n de estas condiciones de servicio, tambi&eacute;n podemos terminar este acuerdo en cualquier momento sin previo aviso, y seguir&aacute;s siendo responsable de todos los montos adeudados hasta incluida la fecha de terminaci&oacute;n; y/o en consecuencia podemos negarte el acceso a nuestros servicios (o cualquier parte del mismo).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>ACUERDO COMPLETO</em></strong></p>\r\n\r\n<p>Nuestra falla para ejercer o hacer valer cualquier derecho o disposici&oacute;n de estas Condiciones de Servicio no constituir&aacute; una renuncia a tal derecho o disposici&oacute;n. Estas Condiciones del servicio y las pol&iacute;ticas o reglas de operaci&oacute;n publicadas por nosotros en este sitio o con respecto al servicio constituyen el acuerdo completo y el entendimiento entre t&uacute; y nosotros y rigen el uso del Servicio y reemplaza cualquier acuerdo, comunicaciones y propuestas anteriores o contempor&aacute;neas, ya sea oral o escrita, entre t&uacute; y nosotros (incluyendo, pero no limitado a, cualquier versi&oacute;n previa de los T&eacute;rminos de Servicio). Cualquier ambig&uuml;edad en la interpretaci&oacute;n de estas Condiciones del servicio no se interpretar&aacute;n en contra del grupo de redacci&oacute;n.</p>\r\n', 'default.jpg', '', 'legales', 'si', '2019-07-19 23:09:44', '2019-07-19 23:09:44', '2019-07-19 23:09:44', 'activo', NULL);
