(8, '', '', '', 'Como Registrarme', 'como-registrarme', ' ', ' <div id=\"carouselAyuda\" class=\"carousel slide\" data-ride=\"carousel\">\r\n          <ol class=\"carousel-indicators\">\r\n            <li data-target=\"#carouselAyuda\" data-slide-to=\"0\" class=\"active\"></li>\r\n            <li data-target=\"#carouselAyuda\" data-slide-to=\"1\"></li>\r\n            <li data-target=\"#carouselAyuda\" data-slide-to=\"2\"></li>\r\n            <li data-target=\"#carouselAyuda\" data-slide-to=\"3\"></li>\r\n            <li data-target=\"#carouselAyuda\" data-slide-to=\"4\"></li>\r\n          </ol>\r\n          <div class=\"carousel-inner\">\r\n            <div class=\"carousel-item active\">\r\n              <img class=\"d-block w-100\" src=\"../assets/global/img/flujos/flujo1.1.png\" alt=\"Registro paso 1\">\r\n              <div class=\"carousel-caption d-none d-md-block\">\r\n                <h5>Paso 1</h5>\r\n                <p>En la barra de navegación superior da click en el menú \"Usuarios\".</p>\r\n              </div>\r\n            </div>\r\n            <div class=\"carousel-item\">\r\n              <img class=\"d-block w-100\" src=\"../assets/global/img/flujos/flujo1.2.png\" alt=\"Registro paso 2\">\r\n              <div class=\"carousel-caption d-none d-md-block\">\r\n                <h5>Paso 2</h5>\r\n                <p>Haz clic en la opción, Registro.</p>\r\n              </div>\r\n            </div>\r\n            <div class=\"carousel-item\">\r\n              <img class=\"d-block w-100\" src=\"../assets/global/img/flujos/flujo1.3.png\" alt=\"Registro paso 3\">\r\n              <div class=\"carousel-caption d-none d-md-block\">\r\n                <h5>Paso 3</h5>\r\n                <p>Llena el formulario de registro con todos tus datos.</p>\r\n              </div>\r\n            </div>\r\n            <div class=\"carousel-item\">\r\n              <img class=\"d-block w-100\" src=\"../assets/global/img/flujos/flujo1.4.png\" alt=\"Registro paso 4\">\r\n    