(13, 'contacto', '', '  Contacto, Abanico, correos electrónicos', 'Contacto', 'contacto', 'Pagina de Contacto', '<h3>&iquest;Tienes dudas? &iquest;Deseas vender o anunciar tus servicios&nbsp;con nosotros?&nbsp;&iquest;Quieres comprar algo?</h3>\r\n\r\n<p>Comun&iacute;cate con nosotros v&iacute;a telef&oacute;nica o Whatsapp al <strong>5571974077</strong> o en los siguientes correos electr&oacute;nicos:</p>\r\n\r\n<hr />\r\n<h3><a href=\"mailto:atencionclientes@abanicoytu.com\">atencionclientes@abanicoytu.com</a></h3>\r\n\r\n<p>Para cualquier duda que tengas sobre como comprar y vender.</p>\r\n\r\n<hr />\r\n<h3><a href=\"mailto:pagos@abanicoytu.com\">pagos@abanicoytu.com</a></h3>\r\n\r\n<p>Dudas y aclaraciones sobre dep&oacute;sitos o pagos que hayas realizado en la tienda o en la activaci&oacute;n de un plan.</p>\r\n\r\n<hr />\r\n<h3><a href=\"mailto:devoluciones@abanicoytu.com\">devoluciones@abanicoytu.com</a></h3>\r\n\r\n<p>Para solicitar devoluciones o consultar el estado de una solicitud.</p>\r\n\r\n<hr />\r\n<h3><a href=\"mailto:concursos@abanicoytu.com\">concursos@abanicoytu.com</a></h3>\r\n\r\n<p>Para dudas e informaci&oacute;n sobre concursos y&nbsp;premios.</p>\r\n\r\n<hr />\r\n<h3><a href=\"mailto:asistenciatecnica@abanicoytu.com\">asistenciatecnica@abanicoytu.com</a></h3>\r\n\r\n<p>Problemas y errores t&eacute;cnicos con el sitio y cuentas de abanico.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'default.jpg', '', 'acerca', 'si', '2019-08-27 14:11:55', '2019-08-20 21:37:08', '2019-08-20 21:37:08', 'activo', 5),
(14, '', '', '', 'Métodos de Pago', 'metodos-de-pago', '          ', '<h3>Compra con nosotros a trav&eacute;s de PayPal utilizando tu tarjeta de cr&eacute;dito&nbsp;y debito.</h3>\r\n\r\n<p><img alt=\"\" src=\"https://abanicoytu.com/assets/global/img/paypal_metodos.png\" style=\"height:86px; width:400px\" /></p>\r\n\r\n<hr />\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>Si lo tuyo no son las tarjetas, no te preocupes, selecciona como m&eacute;todo de pago dep&oacute;sito en &nbsp;OXXO</h3>\r\n\r\n<p><img alt=\"\" src=\"https://abanicoytu.com/assets/global/img/oxxopay_brand.png\" style=\"height:46px; width:200px\" /></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>O dep&oacute;sito en ventanilla en cualquier sucursal de&nbsp; Scotiabank o a trav&eacute;s de una transferencia electr&oacute;nica.</h3>\r\n\r\n<p><img alt=\"\" src=\"https://abanicoytu.com/assets/global/img/banco.png\" style=\"height:150px; width:200px\" /></p>\r\n\r\n<h3>Y te enviaremos todos los datos de referencia y n&uacute;mero de cuenta bancario para que puedas realizar tus pagos y transferencias de forma f&aacute;cil y r&aacute;pida.</h3>\r\n', 'default.jpg', '', 'acerca', 'si', '2019-08-27 14:11:55', '2019-06-24 22:49:13', '2019-06-24 22:49:13', 'activo', 3),
(15, '', '', '', 'Quienes Somos', 'quienes-somos', ' En Abanico hemos decidido dar un giro a la manera de hacer negocios. Nuestra decisión obedece a la firme convicción de que todos debemos ser tratados de manera justa y respetuosa. Frente a la tendencia en el intercambio de bienes y servicios de reducir a las personas a un puro interés económico.     ', '<h4 style=\"font-family: \'Kalam\', cursive;\">En Abanico hemos decidido dar un giro a la manera de hacer negocios. Nuestra decisi&oacute;n obedece a la firme convicci&oacute;n de que todos debemos ser tratados de manera justa y respetuosa. Frente a la tendencia en el intercambio de bienes y servicios de reducir a las personas a un puro inter&eacute;s econ&oacute;mico.</h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4 style=\"font-family: \'Kalam\', cursive;\">Estamos convencidos de que las empresas deben contribuir al progreso de las personas y sus comunidades. Nuestro anhelo es que todos aquellos que ofrecen un servicio o producen alg&uacute;n bien, logren cumplir sus sue&ntilde;os. Nuestra plataforma tiene como objetivo generar un espacio justo, donde los diferentes actores econ&oacute;micos, ya sean de oferta o demanda de productos y servicios, puedan desarrollar su actividad.</h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4 style=\"font-family: \'Kalam\', cursive;\">La &uacute;nica forma en que seremos capaces de enfrentar los grandes desaf&iacute;os econ&oacute;micos de nuestro tiempo es apoy&aacute;ndonos mutuamente. Por eso, te invitamos a que juntos conformemos un equipo vanguardista.</h4>\r\n', 'default.jpg', '', 'acerca', 'si', '2019-08-27 14:11:40', '2019-07-01 16:45:39', '2019-07-01 16:45:39', 'activo', 0),
(16, '', '', '', 'Bases concurso inaugural', 'bases-concurso-inaugural', '      ', '<h2><strong><strong><em>abanicoytu.com</em></strong><strong> invita a todos aquellos interesados en participar en su concurso inaugural que se llevara a cabo del d&iacute;a 24 de Septiembre del 2019 y que entregara un &uacute;nico premio de $10,000.00 MN.</strong></strong></h2>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<p><strong>Para participar &uacute;nicamente debes registrarte en <a href=\"http://www.abanicoytu.com\">www.abanicoytu.com</a>, no es necesario realizar ninguna compra.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>Mec&aacute;nica:</strong></strong></p>\r\n\r\n<ol>\r\n	<li><strong>Reg&iacute;strate a partir del d&iacute;a 8 de julio de 2019 en la p&aacute;gina <a href=\"http://www.abanicoytu.com\">www.abanicoytu.com</a>.</strong></li>\r\n	<li>\r\n	<p><strong>El d&iacute;a 24 de septiembre a las 17 horas (horario de la Ciudad de M&eacute;xico) tendr&aacute;s que buscar, dentro de las descripciones de los productos publicados en la p&aacute;gina, palabras que en su conjunto formaran una frase que ha sido elegida previamente.&nbsp;</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Cuando encuentres las palabras da doble click en ellas para que aparezcan en la parte superior de tu pantalla.&nbsp;</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Una vez que hayas encontrado todas las palabras, procede a ordenarlas hasta encontrar la secuencia correcta y la frase completa.&nbsp;</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Si el concursante cierra su sesi&oacute;n, el avance que haya logrado en el concurso se perder&aacute; y tendr&aacute; que comenzar de nuevo en su siguiente inicio de sesi&oacute;n.&nbsp;</strong></p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>Determinaci&oacute;n del ganador y entrega del premio:</strong></strong></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p><strong>Cuando la frase haya sido completada el sistema se cerrar&aacute; y se identificar&aacute; al ganador mediante el n&uacute;mero de identificaci&oacute;n del usuario.</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>El nombre del ganador y la frase completa ser&aacute;n publicados en la secci&oacute;n &ldquo;Concursos&rdquo; de <a href=\"http://www.abanicoytu.com\">www.abanicoytu.com</a>.&nbsp;</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Un representante de abanico contactar&aacute; al ganador para acordar la entrega del premio.&nbsp;</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>El premio de $10,000.00 ser&aacute; depositado en la cuenta bancaria del ganador.&nbsp;&nbsp;</strong></p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>REGLAS:</strong></strong></p>\r\n\r\n<p><strong><strong>Elegibilidad</strong>:</strong></p>\r\n\r\n<p><strong>El concurso est&aacute; abierto a todo p&uacute;blico que a la fecha de realizaci&oacute;n tenga 18 a&ntilde;os o m&aacute;s y que sea residente legal en la Rep&uacute;blica Mexicana.</strong></p>\r\n\r\n<p><strong>El concursante deber&aacute; de contar a la fecha de entrega del premio con una cuenta bancaria corriente a su nombre.&nbsp;</strong></p>\r\n\r\n<p><strong>No podr&aacute; participar ninguna persona que tenga un v&iacute;nculo laboral directo con Abanico, sus afiliados, proveedores, etc&eacute;tera, ni los familiares inmediatos o que vivan en el mismo hogar que los empleados.&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>Duraci&oacute;n</strong>:&nbsp;</strong></p>\r\n\r\n<p><strong>El registro al concurso se podr&aacute; realizar a partir del 8 de julio hasta el d&iacute;a 23 de septiembre del 2019.&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>Premio:</strong></strong></p>\r\n\r\n<p><strong>Se entregar&aacute; un &uacute;nico premio de $10,000.00 pesos por medio de un dep&oacute;sito interbancario a la cuenta del ganador.&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>No se permitir&aacute; ninguna sustituci&oacute;n de premio, ni transferencia/asignaci&oacute;n del premio a otros o solicitar el equivalente en otra forma de pago.&nbsp;</strong></p>\r\n\r\n<p><strong>Todos los gastos relacionados al premio, incluyendo sin limitaci&oacute;n los impuestos federales, estatales y/o locales, ser&aacute;n responsabilidad exclusiva del Ganador. </strong></p>\r\n\r\n<p><strong>La aceptaci&oacute;n del premio constituye el permiso para que la empresa utilice el nombre e informaci&oacute;n del ganador con fines publicitarios y de comercio sin compensaci&oacute;n posterior.&nbsp;</strong></p>\r\n\r\n<p><strong>La empresa no tendr&aacute; ninguna responsabilidad por informaci&oacute;n de contacto con errores, inv&aacute;lida o no exacta, la imposibilidad del ganador de recibir notificaciones debido a las configuraciones de spam, correo basura u otras medidas de seguridad.&nbsp;</strong></p>\r\n\r\n<p><strong>Si el ganador no puede ser contactado, es inelegible o no reclama el premio dentro de los 3 d&iacute;as posteriores al concurso, el premio podr&aacute; ser retirado y se seleccionar&aacute; como ganador alternativo a la segunda persona que haya finalizado el concurso de acuerdo a los registros del sistema.&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>Aceptaci&oacute;n de las reglas:</strong></strong></p>\r\n\r\n<p><strong>Al participar en el concurso, el concursante (&ldquo;Usted&rdquo;) acepta plena e incondicionalmente estar sujeto a las reglas aqu&iacute; descritas. Al participar, se entender&aacute; que ha le&iacute;do, aceptado y comprendido estas reglas y se compromete a cumplir con los requisitos y condiciones aqu&iacute; establecidos.&nbsp;</strong></p>\r\n\r\n<p><strong>El concursante garantiza que cumple los requisitos para participar. Adem&aacute;s, acepta las decisiones que la empresa tome como definitivas y vinculantes en lo que al concurso se refiere.&nbsp;</strong></p>\r\n\r\n<p><strong>El concursante ganador acepta que su nombre sea publicado en la p&aacute;gina www.abanicoytu.com</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>T&eacute;rminos y condiciones:</strong></strong></p>\r\n\r\n<p><strong>La empresa se reserva el derecho, a su entera discreci&oacute;n, de cancelar, terminar, modificar o suspender el concurso si un virus, bug, intervenci&oacute;n humana no autorizada, fraude, u otra causa m&aacute;s all&aacute; del control de la Compa&ntilde;&iacute;a corrompe o afecta la administraci&oacute;n, seguridad, imparcialidad o conducta apropiada del concurso. La empresa se reserva el derecho, a su entera discreci&oacute;n, de descalificar a cualquier individuo que manipule o intente manipular la operaci&oacute;n del concurso, del sitio web o que viole estos T&eacute;rminos y Condiciones. Y la empresa no ser&aacute; responsable por interrupciones, defectos de cualquier sistema de c&oacute;mputo en l&iacute;nea, equipos de c&oacute;mputo, servidores, proveedores. Ni por la inhabilidad de acceder al sitio durante el tiempo del concurso.</strong></p>\r\n\r\n<p><strong>Cualquier intento por parte de un concursante de da&ntilde;ar deliberadamente el sitio web o perjudicar la operaci&oacute;n leg&iacute;tima del Concurso puede constituir una violaci&oacute;n de las leyes penales y civiles. De ocurrir alg&uacute;n intento de este tipo, la Empresa se reserva el derecho de solicitar indemnizaci&oacute;n en la medida m&aacute;xima permitida por la ley.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>Limitaci&oacute;n de Responsabilidad:</strong></strong></p>\r\n\r\n<p><strong>Al participar en el concurso, el Concursante (incluyendo pero no limitado al ganador) acepta liberar a la Empresa, subsidiarias, afiliados, socios, representantes, agentes, empleados, oficiales y directores de cualquier responsabilidad, enfermedad, lesi&oacute;n, muerte, p&eacute;rdida, litigio, demanda o da&ntilde;o que pueda ocurrir, directa o indirectamente, ya sea por negligencia o no de la participaci&oacute;n del concursante y/o su aceptaci&oacute;n, posesi&oacute;n y uso; por el uso inadecuado de cualquier premio o porci&oacute;n del mismo, por fallas t&eacute;cnicas de cualquier tipo; de la indisponibilidad o inaccesibilidad de cualquier transmisi&oacute;n, tel&eacute;fono o servicio de Internet; la intervenci&oacute;n humana no autorizada en cualquier parte del concurso y de cualquier error t&eacute;cnico o humano en la administraci&oacute;n y desarrollo del concurso.&nbsp;</strong></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong><strong>Disputas:</strong></strong></p>\r\n\r\n<p><strong>El concursante acepta que todas las disputas que no puedan ser resueltas entre las partes ser&aacute;n resueltas individualmente, sin recurrir a ninguna forma de acci&oacute;n colectiva.&nbsp;</strong></p>\r\n\r\n<p><strong>Aceptando estas reglas, el concursante renuncia a obtener indemnizaciones en caso de disputa por da&ntilde;os punitivos, incidentales o consecuentes, as&iacute; como indemnizaciones multiplicadas y aumentadas.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>Pol&iacute;tica de Privacidad:</strong></strong></p>\r\n\r\n<p><strong>&nbsp;La informaci&oacute;n enviada al registrarse para el concurso est&aacute; sujeta a la Pol&iacute;tica de Privacidad presente en el sitio web <a href=\"http://www.abanicoytu.com\">www.abanicoytu.com</a>. Para revisarla, <a href=\"https://abanicoytu.com/publicacion/aviso-de-privacidad-ok6\">haz click aqu&iacute;</a>.&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'default.jpg', '', 'concursos', 'si', '2019-07-14 20:42:59', '2019-07-14 20:42:59', '2019-07-14 20:42:59', 'activo', NULL),
(17, 'Conoce nuestros planes para vendedores y escoge el que más se adapte a tu negocio. ', '', ' planes para vendedores, planes de abanicoytu, venta por internet, planes para venta por internet ', 'Planes vendedores', 'planes-vendedores', 'Conoce nuestros planes de vendedores y escoge el que más se adapte a tu negocio. Te asesoramos paso a paso para que escojas tu plan, subas tu información y comiences a vender.  ', '', 'default.jpg', 'https://www.abanicoytu.com/planes', 'acerca', 'si', '2019-08-29 01:24:57', '2019-08-29 01:24:57', '2019-08-29 01:24:57', 'activo', 1),
