(20, '', '', '', 'Anuncio COMPLETAMENTE GRATIS !!', 'obten-tu-anuncio-completamente-gratis', ' Regístrate antes del 15 de agosto del 2019 y obtén tu anuncio gratis para tus productos y servicios.           ', '<p>Reg&iacute;strate antes del 15 de agosto del 2019 y obt&eacute;n tu anuncio completamente gratis !</p>\r\n\r\n<ul>\r\n	<li>Si lo que quieres es ofertar un producto, tenemos para t&iacute;:&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;3 meses de <strong>ANUNCIO GRATIS</strong> si tu producto es mexicano.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2 meses de <strong>ANUNCIO GRATIS</strong> si&nbsp;tu producto es extranjero.</p>\r\n\r\n<ul>\r\n	<li>Si te interesa ofertar alg&uacute;n servicio, te damos:</li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2 meses de <strong>ANUNCIO GRATIS</strong> con nuestro plan &quot;An&uacute;nciate con nosotros&quot;.&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1 mes de <strong>ANUNCIO GRATIS</strong> con nuestro plan &quot;Paquete completo&quot;.&nbsp;</p>\r\n\r\n<p>Para m&aacute;s informaci&oacute;n acerca de nuestros planes consulta nuestras&nbsp;p&aacute;ginas:</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <a href=\"https://abanicoytu.com/planes\">https://abanicoytu.com/planes</a></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <a href=\"https://abanicoytu.com/planes?tipo=servicios\">https://abanicoytu.com/planes?tipo=servicios</a></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'default.jpg', '', 'acerca', 'si', '2019-08-27 14:11:11', '2019-08-14 00:20:32', '2019-08-14 00:20:32', 'inactivo', 6),
(21, 'Registro para el concurso inaugural.', '', 'concurso inaugural, concursa y gana, concurso abanicoytu, regalo en efectivo           ', 'REGISTRATE, ENCUENTRA LAS PALABRAS Y GANA $10,000.00', 'registrate-encuentra-las-palabras-y-gana-1000000', 'Regístrate y participa en nuestro concurso inaugural buscando las palabras y ganando $10,000.00          ', '<div class=\"text-center py-3\">\r\n<p><a href=\"https://www.abanicoytu.com/usuario/registro_rapido/registro_usuario\" class=\"btn btn-primary btn-lg\">Regístrate aquí</a></p>\r\n<h3 style=\"font-family: \'Kalam\', cursive;\">¿Por qué ofrecemos un regalo en efectivo?</h3>\r\n\r\n<h4 style=\"font-family: \'Kalam\', cursive;\">Porque la mejor referencia es la que se hace de boca en boca.</h4>\r\n\r\n<h4  style=\"font-family: \'Kalam\', cursive;\">Porque preferimos dar un regalo a imprimir publicidad que terminará en la basura. </h4>\r\n\r\n<h4  style=\"font-family: \'Kalam\', cursive;\">Porque sabemos que la situación económica no es la mejor y que un regalo en efectivo puede significar una ayuda en la vida de cualquiera.</h4>\r\n\r\n<h4  style=\"font-family: \'Kalam\', cursive;\">Y porque queremos que pases un rato divertido en nuestro concurso y disfrutes del premio. </h4>\r\n\r\n<h4  style=\"font-family: \'Kalam\', cursive;\">Como mexicanas, sabemos que confiar en otros se ha vuelto una acción difícil de llevar a cabo por lo que queremos demostrarte que aún hay razones para hacerlo. </h4>\r\n\r\n<h4  style=\"font-family: \'Kalam\', cursive;\">Este es nuestro primer concurso y vamos a demostrarte que somos serias y formales. Gracias por confiar en nosotros. </h4>\r\n\r\n<a href=\"https://www.abanicoytu.com/usuario/registro_rapido/registro_usuario\" class=\"btn btn-primary btn-lg\">Regístrate aquí</a>\r\n<a href=\"https://www.abanicoytu.com/publicacion/bases-concurso-inaugural\" class=\"btn btn-outline-primary btn-lg\">Bases del concurso</a>\r\n</div>', 'default.jpg', '', 'acerca', 'si', '2019-09-03 20:37:53', '2019-09-03 20:37:53', '2019-09-03 20:37:53', 'activo', 4);
