(10, '5c0653d43d92e7.75019474', 'Manuel Marmolejo Martínez', 'Diseño Web', 'Diseño, Actualización y desarrollo de sitios web completos', '', 'Diseño Web', 'Diseño, Actualización y desarrollo de sitios web completos', 'Blogs, sitios corporativos, redes sociales, Tiendas virtuales\r\nOlvídate de sitios complicados o llenos de funciones que no necesitas, desarrollamos justo a tu medida.\r\nDiseñamos con las últimas tecnologías en mente, celulares y tabletas son áreas en las que nos especializamos.\r\n\r\nSitios Básicos\r\nNuestra especialidad, usamos las formas, los colores, el ritmo y la composición para darle forma a las ideas mas abstractas\r\n\r\nSitios Auto administrables\r\nNuestra especialidad, usamos las formas, los colores, el ritmo y la composición para darle forma a las ideas mas abstractas\r\n\r\nTiendas virtuales\r\nNuestra especialidad, usamos las formas, los colores, el ritmo y la composición para darle forma a las ideas mas abstractas\r\n\r\nSitios responsivos\r\nNuestra especialidad, usamos las formas, los colores, el ritmo y la composición para darle forma a las ideas mas abstractas\r\n\r\nSitios para Móviles\r\nNuestra especialidad, usamos las formas, los colores, el ritmo y la composición para darle forma a las ideas mas abstractas\r\n\r\nHosting y Dominio\r\nNuestra especialidad, usamos las formas, los colores, el ritmo y la composición para darle forma a las ideas mas abstractas', 'México', 'Ciudad de México', 'Gustavo A. Madero', 'Puedo trabajar para clientes de todo México.', 'default.jpg', 'default.jpg', 0, '0.00', '2019-08-22 00:05:29', '2019-08-22 00:09:01', '2019-08-22 00:05:29', 'digital', 'es', 'activo', 1),
(11, '5d2bbdb5d90354.55000754', 'Citlali Díaz Aguilar', 'emplomado, cooper foil o vitromosaico', 'Vitrales', 'emplomado, cooper foil o vitromosaico', 'Vitrales', 'Vitrales sobre diseño', '<p>los vitrales se realizan sobre dise&ntilde;o, en cualquiera de las t&eacute;cnicas mencionadas.&nbsp;</p>\r\n', 'México', 'Ciudad de México', 'Benito Juárez', 'se realizan en cualquiera de las alcaldías de la Ciudad de México, área metropolitana', 'default.jpg', 'default.jpg', 0, '0.00', '2019-08-22 17:10:35', '2019-09-03 20:43:40', '2019-08-22 17:10:35', 'profesional', 'es', 'activo', 1);
